(387, 'WT-CL-EMB-PR', 'White Tara Embellished Print', '<p>Goddess of Health, Long Life and Prosperity - Tara was born of a tear of Avalokiteshwara. She is the Mother of Compassion who answers all prayers. Tara appears in as many as 21 different forms and colors, of which White and Green are the oldest. Tara offers health, long life, growth, prosperity and protection to all who call on her.</p>\r\n<p>Custom Print, Hand-Embellished With Glitter and Crystals</p>', 'WT-CL-EMB-PR\r\nWhite Tara Embellished Print', 1.000, 1, 0, 1, 0, '2016-02-17 18:59:37', 'WT-CL-EMB-PR', 'White Tara, Goddess Tara, Buddhist Mother of Compassion, Goddess of Compassion, Tara, Buddhist Goddess', '', ''),
(125, 'BRAM-PL', 'Lord Brahma Card', '<p class=\"normal\">Lord Brahma Creator of The Universe Card</p>\r\n<p>Greeting Card&nbsp;With Matching Envelope</p>', 'BRAM-PL\r\n\r\nLord Brahma The Creator Card', 0.000, 1, 0, 1, 0, '2016-05-18 19:04:13', 'BRAM-PL', 'Lord Brahma, Hindu Lord of Creation, Brahma, Brahm, Supreme Being, God of gods, swan vehicle, birds, universal mind, generator of mankind, creator of the universe', 'We\'re temporarily out of stock, but will get this item to you ASAP.', 'If you selected Customized, enter your custom text:'),
