(287, 'MAR-IM-PL', 'Immaculate Mary Card', '<p class=\"normal\">Immaculate Mary Card</p>\r\n<p>Greeting Card&nbsp;With&nbsp;Matching Envelope</p>', 'MAR-IM-PL  \r\nImmaculate Mary Card', 1.000, 1, 0, 1, 0, '2016-04-07 10:29:03', 'MAR-IM-PL', ' Mary, Mother Mary, Virgin Mary, Charles Chambers, Mother of God, The Virgin, Immaculate Mary', '', ''),
(288, 'MAR-IM-EMB', 'Immaculate Mary Embellished Card', '<p>\"O Virgin Mary, My Mother. I give to your Immaculate Heart, my body and my soul, my thoughts and my actions. I want to be what you want me to be, and do just what you want me to do. I am not afraid because you are always with me. Help me to love your Son Jesus, with all my heart. And above all things, take my hand in yours so I can always be with you. Amen.\"</p>\r\n<p>Greeting Card Hand-Embellished With Glitter and Crystals, With Matching Envelope</p>', 'MAR-IM-EMB\r\nImmaculate Mary Embellished Card', 1.000, 1, 0, 1, 0, '2016-02-19 13:27:32', 'MAR-IM-EMB', 'Miraculous Mary, Mary, Mother Mary, Virgin Mary, Mother of God, The Virgin, Divine Mother, Madonna, Immaculate Heart', '', ''),
(127, 'BRAM-EMB', 'Lord Brahma Embellished Card', '<p>Lord Brahma is the Creator of the Universe, the Supreme Being, the God of gods. He is the originator and the generator of mankind, and symbolizes the universal mind and the intellect. Brahma uses the swan as His vehicle. A swan possesses exceptional discernment which enables it to distinguish pure milk from a mixture of milk and water. This conveys the idea that there is only one Supreme Reality from which the entire universe emanates.</p>\r\n<p>Greeting Card&nbsp;Hand-embellished with Glitter and Crystals, with Pearl or Gold Envelope</p>', 'Lord Brahma is the Creator of the Universe, the Supreme Being, the God of gods. He is the originator and the generator of mankind, and symbolizes the universal mind and the intellect. Brahma uses the swan as His vehicle. A swan possesses exceptional discernment which enables it to distinguish pure milk from a mixture of milk and water. This conveys the idea that there is only one Supreme Reality from which the entire universe emanates.', 0.000, 1, 0, 1, 0, '2016-02-20 15:15:49', 'BRAM-EMB', '', 'We\'re temporarily out of stock, but will get this item to you ASAP.', 'If you selected Customized, enter your custom text:'),
