(158, 'GAN-BLK-EMB', 'Lord Ganesh Embellished Card', '<p>Remover of Obstacles - In Hindu mythology, Lord Ganesh (or Ganesha) is the son of Lord Shiva and the Divine Mother Parvati. GANA means \'all existing beings in names and forms,\' and ISHA means \'Lord.\' Ganesh removes all obstacles and ensures success in human endeavors. He is an archetype of Wisdom and Beneficence.</p>\r\n<p>Greeting Card&nbsp;Hand-embellished With Glitter and Crystals, With Matching Envelope</p>', 'GAN-BLK-EMB\r\nLord Ganesh Hand-Embellished Card', 1.000, 1, 0, 1, 0, '2016-02-20 14:59:40', 'GAN-BLK-EMB', 'Ganesh, Hindu God Ganesh, Ganesha, Lord Ganesh, Elephant-Faced God, Hindu Elephant God.', '', ''),
