(186, 'KY-DG2-PL', 'Kuan Yin Riding the Dragon Card', '<p>Kuan Yin, the Bodhisattva of Compassion. Her name means \"Hearer of the Cries of the World.\" She is the most beloved and revered of the Chinese deities. Kuan Yin is the Divine Mother we all long for: merciful, tender, compassionate, loving, protecting and wise. She quietly comes to the aid of her children everywhere. Her mantra is \'Om Mani Padme Hum&sbquo;\' or \'Hail the Jewel (or pearl) in the Lotus.\'</p>\r\n<p>Greeting Card&nbsp;With White Envelope</p>', 'Kuan Yin, the Bodhisattva of Compassion. Her name means \"Hearer of the Cries of the World.\" She is the most beloved and revered of the Chinese deities. Kuan Yin is the Divine Mother we all long for: merciful, tender, compassionate, loving, protecting and wise. She quietly comes to the aid of her children everywhere. Her mantra is \'Om Mani Padme Hum\' or \'Hail the Jewel (or pearl) in the Lotus.\'', 1.000, 1, 1, 1, 0, '2013-06-24 19:59:48', 'KY-DG2-PL', 'Kuan Yin, Guan Yin, Kanon, Gwan Yin, Kuan Shih Yin, Bodhisattva, Goddess of Compassion, Goddess of Mercy, Buddhist Goddess of Compassion, Hearer of Cries, Divine Mother, Jewel in the Lotus, Compassionate Mother, Riding the Dragon, Dragon', '', ''),
(187, 'KY-DG3-PL', 'Bodhisattva Kuan Yin Card', '<p>Kuan Yin is the Bodhisattva of Compassion. Her name means \"Hearer of the Cries of the World.\" She is the most beloved and revered of the Chinese deities. Kuan Yin is the Divine Mother we all long for: merciful, tender, compassionate, loving, protecting and wise. She quietly comes to the aid of her children everywhere. Her mantra is \'Om Mani Padme Hum&sbquo;\' or \'Hail the Jewel (or pearl) in the Lotus.\'</p>\r\n<p>Greeting Card&nbsp;With White Envelope</p>', 'Kuan Yin is the Bodhisattva of Compassion. Her name means \"Hearer of the Cries of the World.\" She is the most beloved and revered of the Chinese deities. Kuan Yin is the Divine Mother we all long for: merciful, tender, compassionate, loving, protecting and wise. She quietly comes to the aid of her children everywhere. Her mantra is \'Om Mani Padme Hum\' or \'Hail the Jewel (or pearl) in the Lotus.\'', 1.000, 1, 1, 1, 0, '2015-02-15 16:42:11', 'KY-DG3-PL', 'Kuan Yin, Guan Yin, Kanon, Gwan Yin, Kuan Shih Yin, Bodhisattva, Goddess of Compassion, Goddess of Mercy, Buddhist Goddess of Compassion, Hearer of Cries, Divine Mother, Jewel in the Lotus, Compassionate Mother.', '', ''),
(188, 'KY-DR2-PL', 'Kuan Yin Riding the Dragon Card', '<p>Kuan yin, Bodhisattva of Compassion - \"Listen to the deeds of Kuan Yin responding compassionately on every side with great vows, deep as the ocean, through inconceivable periods of time, serving innumerable Buddhas, giving great, clear, and pure vows. To hear her name, to see her body, to hold her in the heart, is not in vain, for she can extinguish the suffering of existence.\" ~ From the Buddhist Lotus Sutra</p>\r\n<p>Greeting Card&nbsp;With White Envelope</p>', 'KY-DR2-PL\r\nQuan Yin Riding Her Dragon Print', 1.000, 1, 1, 1, 0, '2016-01-31 12:25:34', 'KY-DR2-PL', 'Kuan Yin, Guan Yin, Kanon, Gwan Yin, Kuan Shih Yin, Bodhisattva, Goddess of Compassion, Goddess of Mercy, Buddhist Goddess of Compassion, Hearer of Cries, Divine Mother, Jewel in the Lotus, Compassionate Mother, Kuan Yin Riding the Dragon, Dragon', '', ''),
