(206, 'MAR-HT-1-PL', 'Mother Mary Card', '<p>Hail Mary! Again and again we greet the Mother of God and our Mother sweet. We look on that beautiful, loving face so full of glory, so full of grace. And we sigh for the day when we shall rest in thy tender arms, on thy loving breast. The day when our exile will be past, when thou shalt show us thy Child at last. ~ Cardinal Wiseman</p>\r\n<p>&nbsp;</p>\r\n<p>Greeting Card&nbsp;With White Envelope</p>', 'Hail Mary! Again and again we greet the Mother of God and our Mother sweet. We look on that beautiful, loving face so full of glory, so full of grace. And we sigh for the day when we shall rest in thy tender arms, on thy loving breast. The day when our exile will be past, when thou shalt show us thy Child at last. ~ Cardinal Wiseman', 1.000, 1, 1, 1, 0, '2016-04-06 16:31:45', 'MAR-HT-1-PL', '', '', ''),
