(209, 'META-PL', 'Archangel Metatron Card', '<p>The name Metatron is from the Greek Meta+Tron meaning Beyond+Matrix. Metatron is the highest of the angels and serves as the celestial scribe. He is one of the most important angels in the heavenly hierarchy and transmits the daily orders of God to the angels Gabriel and Sammael. He is a member of a special group that is permitted to look at God&sbquo;&Auml;&ocirc;s countenance - an honor most angels do not share. In the literature, Metatron is often referred to as \"the Prince of the Countenance.\"</p>\r\n<p>Greeting Card&nbsp;With White Envelope</p>', 'The name Metatron is from the Greek Meta+Tron meaning Beyond+Matrix. Metatron is the highest of the angels and serves as the celestial scribe. He is one of the most important angels in the heavenly hierarchy and transmits the daily orders of God to the angels Gabriel and Sammael. He is a member of a special group that is permitted to look at Gods countenance - an honor most angels do not share. In the literature, Metatron is often referred to as \"the Prince of the Countenance.\"', 1.000, 1, 1, 1, 0, '2013-04-12 17:27:18', 'META-PL', '', '', ''),
