(224, 'SAV-1-PL', 'Goddess Savitri Card', '<p>Goddess Savitri is a manifestation of Goddess Saraswati, the Hindu deity of learning, music, and the arts. She is the consort of Hindu God Brahma. \"A power dwelt in her soul too &nbsp;great for earth. A bliss lived in her too large for heaven, light too intense for thought and love too boundless, for earth\'s emotions lit her skies of mind and &nbsp;spread though her deep and happy seas of soul. All that is sacred in the world drew near to her divine passivity of mood. A marvelous voice of silence breathed its thoughts. All things in Time and Space she had taken for her. In her they moved, in her they lived and were. The whole wide world clung to her for delight.\" ~ Sri Aurobindo</p>\r\n<p>Greeting Card&nbsp;With White Envelope</p>', 'Goddess Savitri is a manifestation of Goddess Saraswati, the Hindu deity of learning, music, and the arts. She is the consort of Hindu God Brahma. \"A power dwelt in her soul too  great for earth. A bliss lived in her too large for heaven, light too intense for thought and love too boundless, for earth\'s emotions lit her skies of mind and  spread though her deep and happy seas of soul. All that is sacred in the world drew near to her divine passivity of mood. A marvelous voice of silence breathed its thoughts. All things in Time and Space she had taken for her. In her they moved, in her they lived and were. The whole wide world clung to her for delight.\" ~ Sri Aurobindo', 1.000, 1, 1, 1, 0, '2015-02-17 19:35:30', 'SAV-1-PL', '', '', ''),
(225, 'SAV-2-PL', 'Goddess Savitri Card', '<p>Goddess Savitri is a manifestation of Goddess Saraswati, the Hindu deity of learning, music, and the arts. She is the consort of Hindu God Brahma. \"A power dwelt in her soul too &nbsp;great for earth. A bliss lived in her too large for heaven, light too intense for thought and love too boundless, for earth\'s emotions lit her skies of mind and &nbsp;spread though her deep and happy seas of soul. All that is sacred in the world drew near to her divine passivity of mood. A marvelous voice of silence breathed its thoughts. All things in Time and Space she had taken for her. In her they moved, in her they lived and were. The whole wide world clung to her for delight.\" ~ Sri Aurobindo</p>\r\n<p>Greeting Card&nbsp;With White Envelope</p>', 'Goddess Savitri is a manifestation of Goddess Saraswati, the Hindu deity of learning, music, and the arts. She is the consort of Hindu God Brahma. \"A power dwelt in her soul too great for Earth. A bliss lived in her too large for heaven, light too intense for thought and love too boundless, for earth\'s emotions lit her skies of mind and  spread though her deep and happy seas of soul. ', 1.000, 1, 1, 1, 0, '2015-02-17 19:36:55', 'SAV-2-PL', '', '', ''),
