(227, 'SHAK-3-PL', 'Goddess Shakti Card', '<p>Divine Feminine Creative Force: The word Shakti is from Sanskrit \"shak\" or \"to be able.\" She is the sacred force or empowerment which is the primordial cosmic energy representing the dynamic forces that move through the entire universe. Shakti is the concept, or personification, of divine feminine creative power, sometimes referred to as \"The Great Divine Mother.\"</p>\r\n<p>Greeting Card&nbsp;With White Envelope</p>', 'Divine Feminine Creative Force: The word Shakti is from Sanskrit \"shak\" or \"to be able.\" She is the sacred force or empowerment which is the primordial cosmic energy representing the dynamic forces that move through the entire universe. Shakti is the concept, or personification, of divine feminine creative power, sometimes referred to as \"The Great Divine Mother.\"', 1.000, 1, 1, 1, 0, '2013-04-12 17:13:36', 'SHAK-3-PL', '', '', ''),
(228, 'SHAK-4-PL', 'Goddess Shakti Card', '<p class=\"normal\">Goddess Shakti Divine Creatrix Card</p>\r\n<p>Greeting Card&nbsp;With&nbsp;Matching Envelope</p>', 'SHAK-4-PL\r\nShakti Card', 1.000, 1, 0, 1, 0, '2016-04-04 17:58:27', 'SHAK-4-PL', 'Shakti, divine feminine, creatrix, creation, divine, goddess', '', ''),
