(910, 'CAN-KY-LP', 'Kuan Yin Candle', '<p class=\"normal\">Bodhisattva Kuan Yin Compassion Candle</p>\r\n<p class=\"smallPrint\">3 X 6 White, unscented, wax pillar candle with a lead-free wick. Burn time 50-60 hours.</p>\r\n<p class=\"normal\">&nbsp;</p>', 'CAN-KY-LP\r\n\r\nKuan Yin Candle', 0.000, 1, 0, 1, 0, '2017-01-31 15:24:43', '', 'candles, white candle, white wax, wax candle, wick, lead-free wick, lead free, 3 X 6 candle, white wax pillar candle, pillar candles, natural wax candle, vegetable wax candle, 60 hour candle, sacred image candle, Kuan Yin Candle, bodhisattva candle, compassion candle, kuan yin, quan yin', '', ''),
