(231, 'SHI-BAT-PL', 'Lord Shiva Card', '<p>\"Om. I bow down to Lord Shiva, who is the creator and protector of the universe, who is the greatest among gods, who has three eyes, who is the annihilator of all the three worlds, one whose throat is blue, who is the conqueror of death, who is the Lord of all, who is propitious who is possessed of all marks of greatness and who is the greatest among Gods. To him my prostrations.\"</p>\r\n<p>Greeting Card&nbsp;With White Envelope</p>', '\"Om. I bow down to Lord Shiva, who is the creator and protector of the universe, who is the greatest among gods, who has three eyes, who is the annihilator of all the three worlds, one whose throat is blue, who is the conqueror of death, who is the Lord of all, who is propitious who is possessed of all marks of greatness and who is the greatest among Gods. To him my prostrations.\"', 1.000, 1, 1, 1, 0, '2013-04-12 21:59:38', 'SHI-BAT-PL', '', '', ''),
(232, 'ST-FR-NR-PL', 'Saint Francis Card', '<p>Hear our humble prayer, O God, for our friends the animals, especially for animals who are suffering; for animals that are overworked, underfed and cruelly treated; for all wistful creatures in captivity that beat their wings against bars; for any that are hunted or lost or deserted or frightened or hungry; for all that must be put death. We entreat for them all Thy mercy and pity, and for those who deal with them we ask a heart of compassion and gentle hands and kindly words. Make us, ourselves, to be true friends to animals, and so to share the blessings of the merciful. ~ Albert Schweitzer&nbsp;</p>\r\n<p>Greeting Card&nbsp;With White Envelope</p>', 'Hear our humble prayer, O God, for our friends the animals, especially for animals who are suffering; for animals that are overworked, underfed and cruelly treated; for all wistful creatures in captivity that beat their wings against bars; for any that are hunted or lost or deserted or frightened or hungry; for all that must be put death. We entreat for them all Thy mercy and pity, and for those who deal with them we ask a heart of compassion and gentle hands and kindly words. Make us, ourselves, to be true friends to animals, and so to share the blessings of the merciful. ~ Albert Schweitzer ', 1.000, 1, 1, 1, 0, '2016-03-29 19:11:06', 'ST-FR-NR-PL', '', '', ''),
