(236, 'URI-MOS-PL', 'Archangel Uriel Card', '<p class=\"normal\">Archangel Uriel Mosaic Card</p>\r\n<p>Greeting Card&nbsp;With Matching Envelope</p>', 'URI-MOS-PL\r\n\r\nArchangel Uriel Card', 1.000, 1, 0, 1, 0, '2016-04-05 10:50:21', 'URI-MOS-PL', 'Uriel, Angel Uriel, Archangel Uriel, God is my Light, master of the powers of law, Angel of Ecology, Angel of Divine Order, Angel of Natural Harmony and Balance, protector of the fairy worlds, Ariel, mosaicAngel Ariel, Angel of transformation, Angel of Focus, Angel of Commitment, Angel of Determination, Angel of Dedication', '', ''),
(848, 'URI-MOS-EMB-PR', 'Archangel Uriel Embellished Print', '<p>The name Uriel means \"God is My Light.\" He is the master of the Powers of Law and is the angel of Ecology, Divine Order, and Natural Harmony and Balance. He looks after the natural world and is the protector of the fairy worlds. In his feminine form he is also known as Ariel. Archangel Uriel can help you to transmute and transform your life through focus, commitment, determination, and dedication.</p>\r\n<p>Custom Print, Hand-Embellished With Glitter and Crystals</p>', 'URI-MOS-EMB-PR\r\n\r\nArchangel Uriel Embellished Print', 0.000, 1, 0, 1, 0, '2016-02-09 13:28:53', 'URI-MOS-EMB-PR', 'Uriel, archangel uriel, angels, archangels, protector, Archangel Ariel', '', ''),
(237, 'VIR-PA-PL', 'Virgin In Paradise Card', '<p class=\"normal\">Virgin In Paradise Card</p>\r\n<p>Greeting Card&nbsp;With&nbsp;Matching Envelope</p>', 'VIR-PA-PL\r\nVirgin In Paradise Card', 1.000, 1, 0, 1, 0, '2016-04-06 16:29:01', 'VIR-PA-PL', 'Virgin, Virgin Mary, Mary, Angels, Virgin and Angels, Mother Mary, Madonna, Angelic Host, Paradise, Elysium, Heaven, music, musicians', '', ''),
(238, 'VIS-LAK-PL', 'Vishnu and Lakshmmi Card', '<p>Lord Vishnu &amp; Goddess Lakshmi.</p>\r\n<p>Greeting Card&nbsp;With White Envelope</p>', 'Lord Vishnu & Goddess Lakshmi', 1.000, 1, 1, 1, 0, '2015-02-17 20:10:32', 'VIS-LAK-PL', '', '', ''),
(239, 'VISH-EMB', 'Lord Vishnu Embellished Card', '<p>The Preserver, Lord of the Heart - \"I bow to Vishnu, with the benign form, reclining on the serpent. The lotus issues forth from the navel and He is the very universe. He is the supreme among the Gods, the consort of Lakshmi, and He resplendent like the sky, and the color of the clouds and with auspicious limbs. His eyes are beautiful like the lotus and He is ever in the hearts of His bevolved devotees. He is the one and only Lord of all this universe and can save us from the cycle of repeated births and deaths.\"</p>\r\n<p>Greeting Card&nbsp;Hand-embellished with Glitter and Crystals, with Pearl or Gold Envelope</p>', 'The Preserver, Lord of the Heart - \"I bow to Vishnu, with the benign form, reclining on the serpent. The lotus issues forth from the navel and He is the very universe. He is the supreme among the Gods, the consort of Lakshmi, and He resplendent like the sky, and the color of the clouds and with auspicious limbs. His eyes are beautiful like the lotus and He is ever in the hearts of His bevolved devotees. He is the one and only Lord of all this universe and can save us from the cycle of repeated births and deaths.\"', 1.000, 1, 0, 1, 0, '2016-02-20 14:53:24', 'VISH-EMB', '', '', ''),
