(292, 'BRAM-PL-PR', 'Lord Brahma Print', '<p>Lord Brahma is the Creator of the Universe, the Supreme Being, the God of gods. He is the originator and the generator of mankind, and symbolizes the universal mind and the intellect. Brahma uses the swan as His vehicle. A swan possesses exceptional discernment which enables it to distinguish pure milk from a mixture of milk and water. This conveys the idea that there is only one Supreme Reality from which the entire universe emanates.</p>\r\n<p>Custom Print</p>', 'Lord Brahma is the Creator of the Universe, the Supreme Being, the God of gods. He is the originator and the generator of mankind, and symbolizes the universal mind and the intellect. Brahma uses the swan as His vehicle. A swan possesses exceptional discernment which enables it to distinguish pure milk from a mixture of milk and water. This conveys the idea that there is only one Supreme Reality from which the entire universe emanates.', 0.000, 1, 0, 1, 0, '2015-02-17 20:15:08', 'BRAM-PL-PR', '', 'We\'re temporarily out of stock, but will get this item to you ASAP.', 'If you selected Customized, enter your custom text:'),
(244, 'AN-PRY-PR', 'Angel In Prayer Print', '<p>\"Angels transcend every religion, every philosophy, every creed. In fact angels have no religion as we know it. Their existence precedes every religious system that has ever existed on earth.\" ~ St. Thomas Aquinas</p>\r\n<p>Custom Print</p>', '\"Angels transcend every religion, every philosophy, every creed. In fact angels have no religion as we know it. Their existence precedes every religious system that has ever existed on earth.\" ~ St. Thomas Aquinas', 0.000, 1, 1, 1, 0, '2014-07-10 16:23:33', 'AN-PRY-PR', 'Prayer, Angel, Angel in Prayer, Heavenly Messenger, Angel Praying', '', 'Enter Your Custom Message Here (an additional fee may apply)'),
(245, 'AN-PRY-EMB-PR', 'Angel In Prayer Embellished Print', '<p class=\"normal\">Angel in Prayer With Candle and Incense Burner</p>\r\n<p>\"Angels transcend every religion, every philosophy, every creed. In fact angels have no religion as we know it. Their existence precedes every religious system that has ever existed on earth.\" ~ St. Thomas Aquinas</p>\r\n<p class=\"normal\">8 X 10 Custom Art Print, Hand-Embellished with Glitter and Crystals</p>', 'AN-PRY-EMB-PR\r\n\r\nAngel in Prayer Embellished Print', 0.000, 1, 0, 1, 0, '2016-05-31 18:18:22', 'AN-PRY-EMB-PR', 'Prayer, Angel, Angel in Prayer, Heavenly Messenger, Angel Praying, incense, incense burner, candles', 'We\'re temporarily out of stock, but will get this item to you ASAP.', 'Enter Your Custom Message Here (an additional fee may apply)'),
(246, 'GAB-FLU-PL-PR', 'Archangel Gabriel Print', '<p>Gabriel means \"God is my strength\". He is one of the most beloved and highest ranked of all angels. Gabriel is the Angel of Annunciation, Resurrection, Mercy, Death and Revelation. He sits at the left hand of God and is guardian of the Garden of Eden, and chief of the cherubim.</p>\r\n<p>Custom Print</p>', 'Gabriel means \"God is my strength\". He is one of the most beloved and highest ranked of all angels. Gabriel is the Angel of Annunciation, Resurrection, Mercy, Death and Revelation. He sits at the left hand of God and is guardian of the Garden of Eden, and chief of the cherubim.', 1.000, 1, 0, 1, 0, '2016-04-07 13:09:32', 'GAB-FLU-PL-PR', 'Archangel Gabriel, Angels, Gabriel, angel of annunciation, highest ranked angel, angel of ressurection, angel of mercy, angel of revelation, God is my strength, left hand of God, guardian of the Garden of Eden, chief of the cherubim', '', ''),
(325, 'GAN-BL-PL-PR', 'Ganesha Purana Print', '<p>In Hindu mythology, Lord Ganesh (or Ganesha) is the son of Lord Shiva and the Divine Mother Parvati. GANA means \'all existing beings in names and forms,\' and ISHA means \'Lord.\' Ganesh removes all obstacles and ensures success in human endeavors. He is an archetype of Wisdom and Beneficence.</p>\r\n<p>Ganesh 8X10&nbsp;Art Print</p>', 'GAN-BL-PL-PR\r\nGanesha Purana, Hindu Elephant-Deity Print', 1.000, 1, 0, 1, 0, '2016-05-21 17:45:33', 'GAN-BLU-PL-PR', 'Ganesh, Hindu God Ganesh, Ganesha, Lord Ganesh, Elephant-Faced God, Hindu Elephant God, Ganesha Purana, art print, Elephant Deity', '', ''),
(249, 'MIC-BLK-PL-PR', 'Archangel Michael Print', '<p>His name means \"Who is as God.\" Michael is the Chief of the Archangels, and is the Angel of Repentance, Righteousness, Mercy and Sanctification. He is also known as \"The Prince of Light,\" a spiritual warrior who wages war against the sons of darkness.</p>', 'His name means \"Who is as God.\" Michael is the Chief of the Archangels, and is the Angel of Repentance, Righteousness, Mercy and Sanctification. He is also known as \"The Prince of Light,\" a spiritual warrior who wages war against the sons of darkness.', 1.000, 1, 0, 1, 0, '2016-04-07 13:10:26', 'MIC-BLK-PL-PR', 'Archangel Michael, Michael, Chief of the Archangels, angel of repentance, angel of righteousness, angel of mercy, angel of sanctification, spiritual warrior, who is as God, the prince of light', '', ''),
(714, 'CHR-GETH-PL-PR', 'Christ in Gethsemane Print', '<p class=\"normal\">Christ in the Garden of Gethsemane</p>\r\n<p class=\"smallPrint\">8 X 10 Custom Art Print</p>', 'CHR-GETH-PL-PR\r\nChrist in the Garden of Gethsemane Print', 0.000, 1, 0, 1, 0, '2016-05-31 18:14:39', 'CHR-GETH-PL-PR', 'Jesus Christ, The Shepherd, The Messiah, Our Lord, The Savior, Jesus, Meditation, Garden Of Gethsemane, Jesus Christ', '', ''),
(373, 'MA-LAK-EMB', 'Goddess Lakshmi Embellished Card', '<p class=\"normal\">Hindu Goddess Embellished Lakshmi Card</p>\r\n<p class=\"normal\">Hindu Goddess of Love, Beauty, and Prosperity</p>\r\n<p class=\"smallPrint\">Greeting Card, Hand-Embellished With Glitter And Crystals, With Matching Envelope</p>', 'MA-LAK-EMB \r\n\r\nHindu Goddess Embellished Lakshmi Card', 1.000, 1, 0, 1, 0, '2016-04-09 16:12:35', 'MA-LAK-EMB', 'Goddess Lakshmi, Lakshmi, Goddess of Love, Goddess of Wealth, Goddess of Abundance, Goddess of Beauty, wealth, prosperity, abundance, wealth, Hindu Goddesses, Goddesses, Maha Lakshmi', '', ''),
(250, 'KYLP-EMB', 'Kuan Yin Embellished Card', '<p>Kuan Yin is the Bodhisattva of Compassion. Her name means \"Hearer of the Cries of the World.\" She is the most beloved and revered of the Chinese deities. Kuan Yin is the Divine Mother we all long for: merciful, tender, compassionate, loving, protecting and wise. She quietly comes to the aid of her children everywhere. Her mantra is \'Om Mani Padme Hum&sbquo;\' or \'Hail the Jewel (or pearl) in the Lotus.\'</p>\r\n<p>Greeting Card Hand-Embellished With Glitter and Crystals, With Matching Envelope</p>', 'KYLP-EMB\r\n\r\nKuan Yin In Lordly Pose Embellished Card', 1.000, 1, 0, 1, 0, '2016-02-15 17:07:05', 'KYLP-EMB', 'Bodhisattva Kuan Yin, Kwan Yin, Guan Yin, Guan Shih Yin, Kuan Shih Yin, Quan Am, Guanyin, Kuanin,Great Mother, Goddess of Mercy, Mother of Compassion, Avalokitesvara, Mazu, A-ma, Matsu, Goddess of the Southern Sea, Kwannon ', '', ''),
