(255, 'GAB-PS-PL', 'Archangel Gabriel Card', '<p>Gabriel means \"God is My Strength.\" He is one of the most beloved and highest ranked of all angels. Gabriel is the Angel of Annunciation, Ressurection, Mercy, Death and Revelation. He sits at the left hand of God and is guardian of the Garden of Eden, and chief of the cherubim.</p><p>Greeting CardWith White Envelope</p>', 'Gabriel means \"God is My Strength.\" He is one of the most beloved and highest ranked of all angels. Gabriel is the Angel of Annunciation, Ressurection, Mercy, Death and Revelation. He sits at the left hand of God and is guardian of the Garden of Eden, and chief of the cherubim.', 0.000, 1, 1, 1, 0, '2013-04-08 13:19:36', 'GAB-PS-PL', 'GAB-PS-PL', 'We\'re temporarily out of stock, but will get this item to you ASAP.', ''),
(324, 'GAN-BL-EMB-PR', 'Lord Ganesh Embellished Print', '<p>In Hindu mythology, Lord Ganesh (or Ganesha) is the son of Lord Shiva and the Divine Mother Parvati. GANA means \'all existing beings in names and forms,\' and ISHA means \'Lord.\' Ganesh removes all obstacles and ensures success in human endeavors. He is an archetype of Wisdom and Beneficence.</p>\r\n<p>Custom Print Hand-embellished with Glitter and Crystals</p>', 'GAN-BL-EMB-PR\r\nLord Ganesha Hand-Embellished 8X10 Print', 1.000, 1, 0, 1, 0, '2016-02-21 17:47:10', 'GAN-BLU-EMB-PR', 'Ganesh, Hindu God Ganesh, Ganesha, Lord Ganesh, Elephant-Faced God, Hindu Elephant God.', '', ''),
(290, 'WWL-EMB', 'Woman With Lotus Embellished Card', '<p>Say not, \"I have found the truth,\" but rather, \"I have found a truth.\" Say not, \"I have found the path of the soul.\" Say rather, \"I have met the soul walking upon my path.\" For the soul walks upon all paths. The soul walks not upon a line, neither does it grow like a reed. The soul unfolds itself like a lotus of countless petals. ~ Kahlil Gibran&nbsp;</p>\r\n<p>Greeting Card&nbsp;Hand-embellished with Glitter and Crystals, with Pearl or Gold Envelope</p>', 'WWL-EMB\r\nSay not, \"I have found the truth,\" but rather, \"I have found a truth.\" Say not, \"I have found the path of the soul.\" Say rather, \"I have met the soul walking upon my path.\" For the soul walks upon all paths. The soul walks not upon a line, neither does it grow like a reed. The soul unfolds itself like a lotus of countless petals. ~ Kahlil Gibran ', 1.000, 1, 0, 1, 0, '2016-02-05 18:41:48', 'WWL-EMB', 'Woman with Lotus, lotus flower cards, Kahlil Gibran, unfolding soul, sacred lotus, spiritual awakening, growth, great beauty, beauty in struggle, purity, national flower of India, ', '', ''),
