(251, 'FORT-EMB', 'Goddess Fortuna Embellished Card', '<p>Fortuna, Goddess of Fortune - Prove to me now herewith sayeth the Lord of Hosts, if I will not open you the windows of Heaven and pour you out a blessing that there shall not be room enough to receive it. ~ Malachi 3:10</p>\r\n<p>Greeting Card&nbsp;Hand-embellished with Glitter and Crystals, with Pearl or Gold Envelope</p>', 'Fortuna, Goddess of Fortune - Prove to me now herewith sayeth the Lord of Hosts, if I will not open you the windows of Heaven and pour you out a blessing that there shall not be room enough to receive it. ~ Malachi 3:10', 0.000, 1, 0, 1, 0, '2016-02-07 12:31:34', 'FORT-EMB', 'Goddess, Goddess of Fortune, Abundance, wealth, riches, gifts, fortune, blessings, giving, Malachi,Heaven, Lord of Hosts', 'We\'re temporarily out of stock, but will get this item to you ASAP.', ''),
(253, 'BUD-AM-EMB', 'Amitabha Buddha Embellished Card', '<p>Amitabha, or Meditation Buddha, is the Buddha of Infinite Light. His hands are held in the Dhyani mudra, symbolizing absolute balance and equanimity. He presides over Pure Land or the Realm of Bliss. His luminous, discriminating awareness transmutes all attachment and desire.</p>\r\n<p>Greeting Card,&nbsp;Hand-Embellished With Glitter And Crystals, With Matching Envelope.</p>', 'BUD-AM-EMB \r\nAmitabha Buddha Card\r\n\r\n', 1.000, 1, 0, 1, 0, '2016-04-03 12:17:37', 'BUD-AM-EMB', 'Amitabha Buddha, Buddha, Buddha the Enlightened one, Buddha of Infinite Light, Lord of Pure Land, Siddhartha, Lord of Peace', '', ''),
(254, 'VISH-2-EMB', 'Lord Vishnu Embellished Card', '<p>I bow to Lord Vishnu. The lotus issues forth from this navel and He is the very Universe. He is the supreme among the Gods, the consort of Lakshmi, and He is resplendent like the sky, with the color of the clouds. His eyes are beautiful like the lotus and He is ever in the hearts of His beloved devotees. He is the one and only Lord of creation and can save us from the cycle of repeated births and deaths.</p>\r\n<p>Greeting Card&nbsp;Hand-embellished with Glitter and Crystals, with Pearl or Gold Envelope</p>', 'I bow to Lord Vishnu. The lotus issues forth from this navel and He is the very Universe. He is the supreme among the Gods, the consort of Lakshmi, and He is resplendent like the sky, with the color of the clouds. His eyes are beautiful like the lotus and He is ever in the hearts of His beloved devotees. He is the one and only Lord of creation and can save us from the cycle of repeated births and deaths.', 1.000, 1, 0, 1, 0, '2016-02-20 14:54:14', 'VISH-2-EMB', 'VISH-2-EMB', '', ''),
(256, 'SHAK-4-EMB', 'Goddess Shakti Embellished Card', '<p>Divine Feminine Creative Force: The word Shakti is from Sanskrit \"shak\" or \"to be able.\" She is the sacred force or empowerment which is the primordial cosmic energy representing the dynamic forces that move through the entire universe. Shakti is the concept, or personification, of divine feminine creative power, sometimes referred to as \"The Great Divine Mother.\"</p>\r\n<p>Greeting Card&nbsp;Hand-embellished with Glitter and Crystals, with Pearl or Gold Envelope</p>', 'SHAK-4-EMB\r\nDivine Feminine Creative Force: The word Shakti is from Sanskrit \"shak\" or \"to be able.\" She is the sacred force or empowerment which is the primordial cosmic energy representing the dynamic forces that move through the entire universe. Shakti is the concept, or personification, of divine feminine creative power, sometimes referred to as \"The Great Divine Mother.\"', 1.000, 1, 1, 1, 0, '2016-02-06 18:40:50', 'SHAK-4-EMB', 'Shakti,feminine, creative force, divine feminine,Divine Mother', '', ''),
(257, 'SHAK-EMB', 'Goddess Shakti Embellished Card', '<p>Divine Feminine Creative Force: The word Shakti is from Sanskrit \"shak\" or \"to be able.\" She is the sacred force or empowerment which is the primordial cosmic energy representing the dynamic forces that move through the entire universe. Shakti is the concept, or personification, of divine feminine creative power, sometimes referred to as \"The Great Divine Mother.\"</p>\r\n<p>Greeting Card&nbsp;Hand-embellished with Glitter and Crystals, with Pearl or Gold Envelope</p>', 'Divine Feminine Creative Force: The word Shakti is from Sanskrit \"shak\" or \"to be able.\" She is the sacred force or empowerment which is the primordial cosmic energy representing the dynamic forces that move through the entire universe. Shakti is the concept, or personification, of divine feminine creative power, sometimes referred to as \"The Great Divine Mother.\"', 1.000, 1, 1, 1, 0, '2013-04-12 17:16:11', 'SHAK-EMB', '', '', ''),
(258, 'SHAK-2-EMB', 'Goddess Shakti Embellished Card', '<p>Divine Feminine Creative Force: The word Shakti is from Sanskrit \"shak\" or \"to be able.\" She is the sacred force or empowerment which is the primordial cosmic energy representing the dynamic forces that move through the entire universe. Shakti is the concept, or personification, of divine feminine creative power, sometimes referred to as \"The Great Divine Mother.\"</p>\r\n<p>Greeting Card,&nbsp;Hand-Embellished With Glitter and Crystals, With Matching&nbsp; Envelope</p>', 'SHAK-2-EMB\r\n\r\nGoddess Shakti Embellished Card', 1.000, 1, 1, 1, 0, '2016-02-17 19:31:45', 'SHAK-2-EMB', '', '', ''),
(857, 'MIC-BLK-EMB', 'Archangel Michael Embellished Card', '<p><span class=\"normal\">Archangel Michael</span><br />His name means \"Who is as God.\"<br />Michael is the Chief of the Archangels, and is the Angel of Repentance, Righteousness, Mercy and Sanctification.<br />He is also known as \"The Prince of Light,\"<br />a spiritual warrior who wages war against the sons of darkness.</p>\r\n<p>Greeting Card, Hand-Embellished With Glitter and Crystals</p>', 'MIC-BLK-EMB\r\n\r\nArchangel Michael Embellished Card', 0.000, 1, 0, 1, 0, '2016-02-17 20:11:17', 'MIC-BLK-EMB', 'Michael, angelic realm, angels, Archangel Michael, Prince of Light, spiritual warrior, archangels', '', ''),
(259, 'SHAK-3-EMB', 'Goddess Shakti Embellished Card', '<p>Divine Feminine Creative Force: The word Shakti is from Sanskrit \"shak\" or \"to be able.\" She is the sacred force or empowerment which is the primordial cosmic energy representing the dynamic forces that move through the entire universe. Shakti is the concept, or personification, of divine feminine creative power, sometimes referred to as \"The Great Divine Mother.\"</p>\r\n<p>Greeting Card&nbsp;Hand-embellished with Glitter and Crystals, with Pearl or Gold Envelope</p>', 'Divine Feminine Creative Force: The word Shakti is from Sanskrit \"shak\" or \"to be able.\" She is the sacred force or empowerment which is the primordial cosmic energy representing the dynamic forces that move through the entire universe. Shakti is the concept, or personification, of divine feminine creative power, sometimes referred to as \"The Great Divine Mother.\"', 1.000, 1, 1, 1, 0, '2013-04-12 17:16:44', 'SHAK-3-EMB', '', '', ''),
(260, 'WT-CL-EMB', 'White Tara Embellished Card', '<p>Goddess of Health, Long Life and Prosperity - Tara was born of a tear of Avalokiteshwar. She is the Mother of Compassion who answers all prayers. Tara appears in as many as 21 different forms and colors, of which White and Green are the oldest. Tara offers health, long life, growth, prosperity and protection to all who call on her.</p>\r\n<p>Greeting Card Hand-Embellished With Glitter and Crystals, With Matching Envelope</p>', 'WT-CL-EMB\r\n\r\nGoddess of Compassion White Tara Embellished Card', 1.000, 1, 0, 1, 0, '2016-02-16 18:57:48', 'WT-CL-EMB', 'White Tara, Goddess Tara, Buddhist Mother of Compassion, Goddess of Compassion, Tara', '', ''),
(261, 'KY-LO-EMB', 'Kuan Yin Embellished Card', '<p>\"Listen to the deeds of Kuan Yin responding compassionately on every side with great vows, deep as the ocean, through inconceivable periods of time, serving innumerable Buddhas, giving great, clear, and pure vows. To hear her name, to see her body, to hold her in the heart, is not in vain, for she can extinguish the suffering of existence.\" ~ From the Buddhist Lotus Sutra</p>\r\n<p>Greeting Card Hand-Embellished With Glitter and Crystals, With Matching Envelope</p>', 'KY-LO-EMB\r\nKyan Yin, Bodhisattva of Compassion Embellished Card', 0.000, 1, 0, 1, 0, '2016-02-15 17:11:19', 'KY-LO-EMB', 'Bodhisattva Kuan Yin, Kwan Yin, Guan Yin, Guan Shih Yin, Kuan Shih Yin, Quan Am, Guanyin, Kuanin,Great Mother, Goddess of Mercy, Mother of Compassion, Avalokitesvara, Mazu, A-ma, Matsu, Goddess of the Southern Sea, Kwannon  ', '', ''),
(793, 'GUAD-PB-EMB-PR', 'Our Lady of Guadalupe Embellished Print', '<p>Our Lady of Guadalupe&nbsp;</p>\r\n<p>From an Original Watercolor by Santa Fe Artist Patti Blair</p>\r\n<p>Hand-Embellished Print With Glitter and Crystals</p>', 'GUAD-PB-EMB-PR\r\nOur Lady of Guadalupe Embellished Print', 0.000, 1, 0, 1, 0, '2016-02-06 18:13:58', 'GUAD-PB-EMB-PR', 'Our Lady of Guadalupe, Virgin of Guadalupe, The Virgin, Mary', '', ''),
(262, 'BUD-MD-EMB', 'Medicine Buddha Embellished Card', '<p>The Master of remedies releases all sentient beings from affliction. He holds in his right hand a sprig of chebulic myrobalm from which Tibetan medicine is compounded. In his left hand he holds a bowl that contains three forms of ambrosia: the nectar that cures disease and resurrects the dead: the nectar that counteracts aging; and the supreme nectar that illuminates the mind and increases knowledge.</p>\r\n<p>Greeting Card&nbsp;Hand-Embellished With Glitter and Crystals, With Matching Envelope</p>', 'MED-BUD-EMB\r\nMedicine Buddha Embellished Card', 0.000, 1, 0, 1, 0, '2016-02-16 16:26:18', 'BUD-MD-EMB', 'Medicine Buddha, Buddha, Tibetan Medicine Buddha, Master of Remedies, Buddha The Healer, Prince of Peace, Siddhartha', '', ''),
(263, 'BUD-SA-EMB', 'Sakyamuni Buddha Embellished Card', '<p>The Enlightened One - Buddha, in the sixth century BC, at the age of 35, invoked the earth as his witness when he attained Enlightenment. This is indicated by the fingers of his right hand in the \"gesture of touching the earth\". The sun and moon stood still, and all the creatures of the world came to offer obeisance to the Supreme One sitting under the Bodhi Tree.</p>\r\n<p>Greeting Card,&nbsp;Hand-Embellished With Glitter and Crystals, With Matching Envelope</p>', 'BUD-SA-EMB\r\nSakyamuni Buddha Embellished Card', 1.000, 1, 0, 1, 0, '2016-02-16 16:37:24', 'BUD-SA-EMB', 'The Supreme One, Buddha, Master of Remedies, Buddha The Healer, Prince of Peace, Siddhartha, Buddha The Enlightened One, Sakyamuni Buddha, Bodhi Tree', '', ''),
(785, 'BUD-BEL-EMB-PR', 'The Buddha Embellished Print', '<p>The Buddha</p>\r\n<p>Hand-Embellished Print With Crystals and Glitter</p>', 'BUD-BEL-EMB-PR\r\nThe Buddha Embellished Print', 0.000, 1, 0, 1, 0, '2016-02-16 18:01:53', 'BUD-BEL-EMB-PR', 'Buddha, Buddha the Enlightened one, Buddha of Infinite Light, Lord of Pure Land, Siddhartha, Lord Buddha', '', ''),
(265, 'KY-OL-PL', 'Kuan Yin Card', '<p>Kuan Yin is the Bodhisattva of Compassion. Her name means \"Hearer of the Cries of the World.\" She is the most beloved and revered of the Chinese deities. Kuan Yin is the Divine Mother we all long for: merciful, tender, compassionate, loving, protecting and wise. She quietly comes to the aid of her children everywhere. Her mantra is \'Om Mani Padme Hum&sbquo;\' or \'Hail the Jewel (or pearl) in the Lotus.\'</p>\r\n<p>Greeting Card&nbsp;With White Envelope</p>', 'KY-OL-PL\r\n\r\nGoddess Guan Yin', 0.000, 1, 1, 1, 0, '2015-03-07 16:53:38', 'KY-LO-PL', 'Kuan Yin, Guan Yin, Kanon, Gwan Yin, Kuan Shih Yin, Bodhisattva, Goddess of Compassion, Goddess of Mercy, Buddhist Goddess of Compassion, Hearer of Cries, Divine Mother, Jewel in the Lotus, Compassionate Mother.', '', ''),
(687, 'SHAK-4-GD-PL', 'Shakti, Divine Feminine Creative Force Card', '<p>Shakti, Divine Feminine Creative Force&nbsp;of the Universe</p>\r\n<p>Greeting Card With White Envelope</p>', 'SHAK-4-GD-PL\r\nGoddess Shakti', 0.000, 1, 1, 1, 0, '2015-02-10 13:19:31', 'SHAK-4-GD-PL', 'Shakti, divine creatrix, divine feminine creative force, divine feminine', '', ''),
(266, 'KY-DG-EMB', 'Kuan Yin Riding The Dragon Embellished Card', '<p class=\"normal\">Kuan Yin On The Dragon Embellished Card</p>\r\n<p>Greeting Card Hand-Embellished With Glitter And Crystals, With Matching Envelope</p>', 'KY-DG-EMB\r\nKuan Yin On The Dragon Embellished Card', 1.000, 1, 0, 1, 0, '2016-04-07 13:28:53', 'KY-DG-EMB', 'Bodhisattva Kuan Yin, Kwan Yin, Guan Yin, Guan Shih Yin, Kuan Shih Yin, Quan Am, Guanyin, Kuanin,Great Mother, Goddess of Mercy, Mother of Compassion, Dragons, Avalokitesvara, Mazu, A-ma, Matsu, Goddess of the Southern Sea, Kwannon ', '', ''),
(880, 'AN-CAN-PAS-PL', 'Antelope Canyon Passage Card', '<p class=\"normal\">Passage&nbsp;Through Antelope Canyon, Arizona,&nbsp;Card</p>\r\n<p>Greeting Card With Matching Envelope</p>', 'AN-CAN-PAS-PL\r\nAntelope Canyon Passage Card', 0.000, 1, 0, 1, 0, '2016-03-05 20:19:11', 'AN-CAN-PAS-PL', 'passage, Antelope Canyon, Arizona, canyons, paths, rocks', '', ''),
(267, 'GT-1-EMB', 'Green Tara Embellished Card', '<p>Tara was born of a tear of Avalokiteshwara -- she is the Mother of Compassion who answers all prayers. Tara appears in as many as 21 different forms and colors, of which White and Green are the oldest. Tara offers health, long life, growth, prosperity and protection to all who call on her.</p>\r\n<p>Greeting Card Hand-Embellished With Glitter and Crystals, With Matching Envelope</p>', 'GT-1-EMB\r\n\r\nGoddess Green Tara Card', 1.000, 1, 0, 1, 0, '2016-02-16 19:09:18', 'TAR-GN-EMB', 'Green Tara, Goddess Tara, Buddhist Mother of Compassion, Goddess of Compassion, Tara', '', '');
