(396, 'GT-1-EMB-PR', 'Green Tara Embellished Print', '<p>Tara was born of a tear of Avalokiteshwara -- she is the Mother of Compassion who answers all prayers. Tara appears in as many as 21 different forms and colors, of which White and Green are the oldest. Tara offers health, long life, growth, prosperity and protection to all who call on her.</p>\r\n<p>Custom Print, Hand-Embellished With Glitter and Crystals</p>', 'GT-1-EMB-PR \r\n\r\nGreen Tara Embellished Print', 1.000, 1, 0, 1, 0, '2016-02-16 19:14:40', 'TAR-GN-EMB-PR', 'Green Tara, Goddess Tara, Buddhist Mother of Compassion, Goddess of Compassion, Tara, Art Print', '', ''),
(268, 'JE-LO-EMB', 'Jesus Christ in Lotus Posture Embellished Card', '<p>The Lord is my shepherd; I shall not want.&nbsp;He maketh me to lie down in green pastures: he leadeth me beside the still waters. He restoreth my soul: he leadeth me in the paths of righteousness for his name\'s sake. Yea, though I walk through the valley of the shadow of death, I will fear no evil: for thou art with me; thy rod and thy staff they comfort me. Thou preparest a table before me in the presence of mine enemies: thou anointest my head with oil; my cup runneth over. Surely goodness and mercy shall follow me all the days of my life: and I will dwell in the house of the Lord for ever. ~ 23rd Psalm</p>\r\n<p>Greeting Card Hand-Embellished With Glitter and Crystals, With Matching Envelope</p>', 'JE-LO-EMB\r\nJesus Christ in Lotus Posture Embellished Card', 1.000, 1, 0, 1, 0, '2016-02-19 13:45:32', 'JE-LO-EMB', 'Jesus Christ, Lotus Posture, Yoga, The Shepherd, The Messiah, Our Lord, The Saviour, Christ in the Wilderness, Jesus, Meditation, Wilderness', '', ''),
(291, 'BUD-AM-PL', 'Buddha Card', '<p>Greeting CardWith White Envelope</p>', 'Bud-AM-PL', 1.000, 1, 1, 1, 0, '2013-04-09 14:42:24', 'Bud-AM-PL', 'Bud-AM-PL', '', ''),
(269, 'CHR-HT-EMB', 'Christ The Compassionate Embellished Card', '<p class=\"normal\">Christ The Compassionate One, By Charles B. Chambers,&nbsp;Embellished Card</p>\r\n<p>Greeting Card, Hand-Embellished With Glitter And Crystals, With Matching Envelope</p>', 'CHR-HT-EMB\r\nChrist The Compassionate  Embellished Card', 0.000, 1, 0, 1, 0, '2016-05-16 12:39:35', 'CHR-HT-EMB', 'Jesus, Jesus Christ, The Compassionate One, Christ, The Lord, Our Saviour, The Messiah, Compassion, Compassionate Jesus, Our Father, Jesus, Son of God, Sacred Heart', '', 'Enter Your Custom Message Here (an additional fee may apply)'),
(858, 'MC-MOD-EMB', 'Mary and Child Embellished Card', '<p>Mary and Child Embellished Card</p>\r\n<p>Greeting Card Hand-Embellished With Glitter and Crystals, With Matching Envelope</p>', 'MC-MOD-EMB\r\nMary and Child Embellished Card', 0.000, 1, 0, 1, 0, '2016-02-19 14:30:23', 'MC-MOD-EMB', 'Mary and Child, Mother and Child, Mary and Baby Jesus, Madonna and Child, Mary and The Holy Child', '', ''),
(270, 'KAL-BLK-EMB', 'Kali Embellished Card', '<p>Slayer of Time &amp; Death, Destroyer of Illusion: Kali literally means both \'death\' and \'time.\' Goddess Kali represents the state where time, space and causation have disappeared. She is both the destroyer and creatrix and is the consort of Lord Shiva. \"My child, you need not know much in order to please Me. &nbsp;Only Love Me dearly. Speak to me, as you would talk to your mother, if she had taken you in her arms.\"</p>\r\n<p>Greeting Card&nbsp;Hand-embellished with Glitter and Crystals, with Pearl or Gold Envelope</p>', 'Slayer of Time & Death, Destroyer of Illusion: Kali literally means both \'death\' and \'time.\' Goddess Kali represents the state where time, space and causation have disappeared. She is both the destroyer and creatrix and is the consort of Lord Shiva. \"My child, you need not know much in order to please Me.  Only Love Me dearly. Speak to me, as you would talk to your mother, if she had taken you in her arms.\"', 0.000, 1, 0, 1, 0, '2016-02-20 15:09:48', 'KAL-BLK-EMB', '', 'We\'re temporarily out of stock, but will get this item to you ASAP.', 'Enter Your Custom Message Here (an additional fee may apply)'),
(271, 'SHI-N-EMB', 'Lord Shiva Embellished Card', '<p>Lord Shiva is the third deity in the Hindu Triad. Shiva represents the aspect of the Supreme Reality that continuously dissolves and recreates the universe. He is the Lord of Mercy and Compassion since without the cyclic process of evolution souls could not evolve and attain liberation. Shiva protects his devotees from lust, greed, and anger. He is the most kind-hearted God who grants boons and bestows grace to his devotees.</p>\r\n<p>Greeting Card&nbsp;Hand-Embellished With Glitter and Crystals, With Matching Envelope</p>', 'SHI-N-EMB\r\nLord Shiva Hand-Embellished Card', 0.000, 1, 0, 1, 0, '2016-02-21 17:16:39', 'SHI-N-EMB', 'Shiva, Lord Shiva, Hindu Lord, Hindu Lord of Dissolution, Shiva the Destroyer, Lord of Mercy and Compassion, One God of the Hindu Trinity', 'We\'re temporarily out of stock, but will get this item to you ASAP.', 'Enter Your Custom Message Here (an additional fee may apply)'),
(272, 'SHI-D-EMB', 'Lord Shiva Embellished Card', '<p>Lord Shiva is the third deity in the Hindu Triad. Shiva represents the aspect of the Supreme Reality that continuously dissolves and recreates the universe. &nbsp;He is the Lord of Mercy and Compassion since without the cyclic process of evolution, souls could not evolve and attain liberation.</p>\r\n<p>Greeting Card&nbsp;Hand-Embellished With Glitter and Crystals, With Matching Envelope</p>', 'SHI-D-EMB\r\nLord Shiva Embellished Card', 0.000, 1, 0, 1, 0, '2016-02-20 14:47:25', 'SHI-D-EMB', 'Shiva, Lord Shiva, Hindu Lord, Hindu Lord of Dissolution, Shiva the Destroyer, Lord of Mercy and Compassion, One God of the Hindu Trinity', 'We\'re temporarily out of stock, but will get this item to you ASAP.', 'Enter Your Custom Message Here (an additional fee may apply)'),
(273, 'SARA-ST-EMB', 'Goddess Saraswati Embellished Card', '<p>Saraswati is the Goddess of Creativity, Inspiration &amp; Language. She is the consort of Brahma the Creator and is the Procreatrix or Mother of the entire Creation. Saraswati means \"the flowing one.\" She is the personification of all knowledge - arts, language, music, mathematics and science.</p>\r\n<p>Greeting Card&nbsp;Hand-Embellished With Glitter and Crystals, With Matching Envelope</p>', 'SARA-ST-EMB\r\nGoddess Saraswati Embellished Card', 0.000, 1, 0, 1, 0, '2016-02-21 17:22:04', 'SARA-ST-EMB', 'Saraswati, Hindu Goddess Saraswati, Goddess Saraswati, Hindu Goddess, goddess of learning, goddess of inspiration, mother of creation, mother of all knowledge, goddess of music, goddess of art, goddess of language, goddess of science, goddess of mathematics', 'We\'re temporarily out of stock, but will get this item to you ASAP.', 'Enter Your Custom Message Here (an additional fee may apply)'),
(868, 'M-CEL-PL', '&quot;Celebrate&quot; Card', '<p class=\"normal\">\"Celebrate\" Card, Image by Maxfield Parrish</p>\r\n<p>Greeting Card With Matching Envelope</p>', 'M-CEL-PL\r\n\"Celebrate\" Card', 0.000, 1, 0, 1, 0, '2016-03-02 12:38:56', 'M-CEL-PL', 'celebration, Maxfield Parrish, celebrate, special occasion', '', ''),
(274, 'LAK-EMB', 'Goddess Lakshmi Embellished Card', '<p class=\"normal\">Goddess Lakshmi Embellished Card</p>\r\n<p class=\"normal\">Hindu Goddess of Love, Beauty, and Prosperity</p>\r\n<p>Greeting Card,&nbsp;Hand-Embellished With Glitter And Crystals, With Matching Envelope</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'LAK-EMB \r\n\r\nHindu Goddess Lakshmi Embellished Card', 1.000, 1, 0, 1, 0, '2016-04-09 16:13:58', 'LAK-EMB', 'Goddess Lakshmi, Lakshmi, Goddess of Love, Goddess of Wealth, Goddess of Abundance, Goddess of Beauty, wealth, prosperity, abundance, wealth, Hindu Goddesses, Goddesses, Maha Lakshmi', '', ''),
(893, 'CHR-33-PL', 'Christ At 33 Card', '<p class=\"normal\">Christ At 33 Card, By Heinrich Hoffmann</p>\r\n<p class=\"normal\"><span class=\"smallPrint\">Greeting Card With Matching Envelope</span></p>', 'CHR-33-PL\r\nChrist At 33 Card', 0.000, 1, 0, 1, 0, '2016-04-09 16:58:30', 'CHR-33-PL', 'Christ, Jesus Christ, Heinrich Hoffmann, Christ at 33, Jesus, The Lord, Our Saviour', '', ''),
(370, 'LAK-EMB-PR', 'Goddess Lakshmi Embellished Print', '<p>Salutations to you, Oh Goddess Lakshmi. You are the divine mother, the seat of all prosperity, and worshipped even by the Gods. You hold the conch, the divine wheel and the mace in your hands. We worship the great Goddess and all Hail to the spouse of Vishnu. May Mother Lakshmi stimulate us and make us flourish.</p>\r\n<p>Embellished Handmade Print</p>', 'Salutations to you, Oh Goddess Lakshmi. You are the divine mother, the seat of all prosperity, and worshipped even by the Gods. You hold the conch, the divine wheel and the mace in your hands. We worship the great Goddess and all Hail to the spouse of Vishnu. May Mother Lakshmi stimulate us and make us flourish.', 1.000, 1, 0, 1, 0, '2016-02-21 17:44:21', 'LAK-EMB-PR', '', '', ''),
(275, 'K&R-EMB', 'Krishna & Radha Embellished Card', '<p>Lord Krishna is the eighth incarnation of Lord Vishnu. He is the supreme<br />statesman, warrior, hero, teacher and philosopher, and author of the Bhagavad Gita. He has been called \'The Divine Ecstatic\' because the sound of Krishna\'s flute beckons souls to awaken and to become absorbed in the call of the Divine. Radha is Lord Krishna\'s consort. She symbolizes the individual soul that yearns for, and then awakens to the love of God: finally realizing complete Divine Union.</p>\r\n<p>Greeting Card&nbsp;Hand-embellished With Glitter and Crystals, With Matching Envelope</p>', 'K&R-EMB\r\n\r\nKrishna and Radha Hand-Embellished Card', 1.000, 1, 0, 1, 0, '2016-02-20 15:04:30', 'K&R-EMB', 'Krishna and Radha, Hindu Divine Couple, Lord Krishna and His Consort Radha', '', ''),
(277, 'HAN-2-EMB', 'Lord Hanuman Embellished Card', '<p>God of Loyalty, Devotion and Service, Hanuman inspires us to develop strength and purity to become perfect servants of the Divine. \"I salute, by bowing down my head, the messenger of Sri Rama, Hanuman, who travels as fast as the mind and the wind, who has won over his sense organs, who is the best among the intelligent, who is the son of the wind god and who is the commander in chief of the army of monkeys.\"</p>\r\n<p>Greeting Card&nbsp;Hand-embellished with Glitter and Crystals, with Pearl or Gold Envelope</p>', 'God of Loyalty, Devotion and Service, Hanuman inspires us to develop strength and purity to become perfect servants of the Divine. \"I salute, by bowing down my head, the messenger of Sri Rama, Hanuman, who travels as fast as the mind and the wind, who has won over his sense organs, who is the best among the intelligent, who is the son of the wind god and who is the commander in chief of the army of monkeys.\"', 1.000, 1, 1, 1, 0, '2013-04-13 09:41:16', 'HAN-2-EMB', '', '', ''),
(278, 'SAV-1-EMB', 'Goddess Savitri Embellished Card', '<p>Goddess Savitri is a manifestation of Goddess Saraswati, the Hindu deity of learning, music, and the arts. She is the consort of Hindu God Brahma. \"A power dwelt in her soul too &nbsp;great for earth. A bliss lived in her too large for heaven, light too intense for thought and love too boundless, for earth\'s emotions lit her skies of mind and &nbsp;spread though her deep and happy seas of soul. All that is sacred in the world drew near to her divine passivity of mood. A marvelous voice of silence breathed its thoughts. All things in Time and Space she had taken for her. In her they moved, in her they lived and were. The whole wide world clung to her for delight.\" ~ Sri Aurobindo</p>\r\n<p>Greeting Card&nbsp;With White Envelope</p>', 'SAV-1-EMB\r\nGoddess Savitri is a manifestation of Goddess Saraswati, the Hindu deity of learning, music, and the arts. She is the consort of Hindu God Brahma. \"A power dwelt in her soul too  great for earth. A bliss lived in her too large for heaven, light too intense for thought and love too boundless, for earth\'s emotions lit her skies of mind and  spread though her deep and happy seas of soul.', 1.000, 1, 1, 1, 0, '2013-09-29 17:30:28', 'SAV-1-EMB', 'Savriti, manifestation of saraswati, goddess savriti', '', ''),
(279, 'SAR-4-EMB', 'Goddess Saraswati Embellished Card', '<p>Saraswati is the Goddess of Creativity, Inspiration &amp; Language. She is the consort of Brahma the Creator and is the Procreatrix or Mother of the entire Creation. Saraswati means \"the flowing one.\" She is the personification of all knowledge - arts, language, music, mathematics and science.</p>\r\n<p>Greeting Card&nbsp;Hand-embellished with Glitter and Crystals, with Pearl or Gold Envelope</p>', 'SAR-4-EMB\r\n\r\nSaraswati is the Goddess of Creativity, Inspiration & Language. She is the consort of Brahma the Creator and is the Procreatrix or Mother of the entire Creation. Saraswati means \"the flowing one.\" She is the personification of all knowledge - arts, language, music, mathematics and science.', 1.000, 1, 0, 1, 0, '2016-02-20 15:27:19', 'SAR-4-EMB', 'Saraswati, Hindu Goddess Saraswati, Goddess Saraswati, Hindu Goddess, goddess of learning, goddess of inspiration, mother of creation, mother of all knowledge, goddess of music, goddess of art, goddess of language, goddess of science, goddess of mathematics', '', ''),
(280, 'DUR-4-EMB', 'Goddess Durga Embellished Card', '<p>Banisher of Darkness, Durga means Invincible. She is all forms of the Divine Mother herself. She is produced from the radiance of all the gods and therefore has their essence in her. Durga is the Divine Mother who protects people from selfishness, jealousy, hatred, anger and ego. She is the slayer of all evil (ignorance) and establisher of harmony. Mother\'s love and kindness towards her children is the best example of pure love in the universe.</p>\r\n<p>Greeting Card&nbsp;Hand-embellished with Glitter and Crystals, with Pearl or Gold Envelope</p>', 'Banisher of Darkness, Durga means Invincible. She is all forms of the Divine Mother herself. She is produced from the radiance of all the gods and therefore has their essence in her. Durga is the Divine Mother who protects people from selfishness, jealousy, hatred, anger and ego. She is the slayer of all evil (ignorance) and establisher of harmony. Mother\'s love and kindness towards her children is the best example of pure love in the universe.', 1.000, 1, 1, 1, 0, '2014-09-25 11:19:20', 'DUR-4-EMB', '', '', ''),
(281, 'VIS-LAK-EMB', 'Vishnu & Lakshmi Embellished Card', '<p>Lord Vishnu &amp; Goddess Lakshmi.</p>\r\n<p>Greeting Card&nbsp;Hand-embellished with Glitter and Crystals, with Pearl or Gold Envelope</p>', 'Lord Vishnu & Goddess Lakshmi', 0.000, 1, 1, 1, 0, '2013-04-12 22:06:51', 'VIS-LAK-EMB', '', 'We\'re temporarily out of stock, but will get this item to you ASAP.', ''),
(282, 'DUR-2-EMB', 'Goddess Durga Embellished Card', '<p>Banisher of Darkness, Durga means Invincible. She is all forms of the Divine Mother herself. She is produced from the radiance of all the gods and therefore has their essence in her. Durga is the Divine Mother who protects people from selfishness, jealousy, hatred, anger and ego. She is the slayer of all evil (ignorance) and establisher of harmony. Mother\'s love and kindness towards her children is the best example of pure love in the universe.</p>\r\n<p>Greeting Card&nbsp;Hand-embellished with Glitter and Crystals, with Pearl or Gold Envelope</p>', 'Banisher of Darkness, Durga means Invincible. She is all forms of the Divine Mother herself. She is produced from the radiance of all the gods and therefore has their essence in her. Durga is the Divine Mother who protects people from selfishness, jealousy, hatred, anger and ego. She is the slayer of all evil (ignorance) and establisher of harmony. Mother\'s love and kindness towards her children is the best example of pure love in the universe.', 0.000, 1, 1, 1, 0, '2013-04-13 09:48:42', 'DUR-2-EMB', '', 'We\'re temporarily out of stock, but will get this item to you ASAP.', ''),
(283, 'KAL-BLU-EMB', 'Goddess Kali Embellished Card', '<p>Slayer of Time &amp; Death, Destroyer of Illusion - Only when you drink from the river of silence shall you indeed sing. And when you have reached the mountain top, then you shall begin to climb. And when the earth shall claim your limbs, then you shall truly dance.</p>\r\n<p>Greeting Card&nbsp;Hand-Embellished With Glitter and Crystals, With Matching Envelope</p>', 'KAL-BLU-EMB\r\nMaha Kali Embellished Card', 0.000, 1, 0, 1, 0, '2016-02-20 15:09:07', 'KAL-BLU-EMB', 'Kali, Hindu Goddess Kali, The Destroyer and Creatrix, Consort of Lord Shiva, The Black Goddess, Kali Ma, Mother of Durga, Goddess Kali', 'We\'re temporarily out of stock, but will get this item to you ASAP.', ''),
(284, 'MC-LIL-EMB', 'Mother Mary Embellished Card', '<p>A Child\'s Prayer to Mary of the Lilies - \"O Virgin Mary, My Mother. I give to your Immaculate Heart, my body and my soul, my thoughts and my actions. I want to be what you want me to be, and do just what you want me to do. I am not afraid because you are always with me. Help me to love your Son Jesus, with all my heart. And above all things, take my hand in yours so I can always be with you. Amen.\"</p>\r\n<p>Greeting Card Hand-Embellished With Glitter and Crystals, With Matching Envelope</p>', 'MC-LIL-EMB\r\nMother and Child of The Lilies Embellished Card', 0.000, 1, 0, 1, 0, '2016-02-19 13:41:27', 'MC-LIL-EMB', 'Mary and Child, Mother and Child, Mary and Baby Jesus, Madonna and Child, Orthodox Mother and Child, Lilies, Flowers', 'We\'re temporarily out of stock, but will get this item to you ASAP.', ''),
(289, 'MAR-OB-EMB', 'Mother Mary Embellished Card', '<p class=\"normal\">Ostra Brama Mary, Circa 1570. This icon is presently found in he chapel of the Dawn Gate of Vilinius, in Lithuania.</p>\r\n<p>Greeting Card, Hand-Embellished With Glitter And Crystals, With Matching Envelope</p>', 'MAR-OB-EMB\r\nOstra Brama Mary Embellished Card', 1.000, 1, 0, 1, 0, '2016-04-08 17:40:42', 'MAR-OB-EMB', 'Miraculous Mary, Mary, Mother Mary, Virgin Mary, Mother of God, The Virgin, Divine Mother, Madonna, Ostra Brama Mary, Dawn Gate', '', ''),
(892, 'MAR-HUM-EMB-PR', 'Mary In Humility Embellished Print', '<p class=\"normal\">Mary In Humility Embellished Print, From A Russian Orthodox Icon</p>\r\n<p class=\"normal\">8 X 10 Custom Print, Hand-Embellished With Glitter And Crystals</p>', 'MAR-HUM-EMB-PR\r\nMary In Humility 8 X 10 Embellished Print', 0.000, 1, 0, 1, 0, '2016-04-08 17:53:12', 'MAR-HUM-EMB-PR', 'humility, mother mary, virtues, mother mary, Russian Orthodox, icons, madonna', '', ''),
(293, 'BRAM-EMB-PR', 'Lord Brahma Embellished Print', '<p>Lord Brahma is the Creator of the Universe, the Supreme Being, the God of gods. He is the originator and the generator of mankind, and symbolizes the universal mind and the intellect. Brahma uses the swan as His vehicle. A swan possesses exceptional discernment which enables it to distinguish pure milk from a mixture of milk and water. This conveys the idea that there is only one Supreme Reality from which the entire universe emanates.</p>\r\n<p>Custom Print Hand-embellished with Glitter and Crystals</p>', 'Lord Brahma is the Creator of the Universe, the Supreme Being, the God of gods. He is the originator and the generator of mankind, and symbolizes the universal mind and the intellect. Brahma uses the swan as His vehicle. A swan possesses exceptional discernment which enables it to distinguish pure milk from a mixture of milk and water. This conveys the idea that there is only one Supreme Reality from which the entire universe emanates.', 0.000, 1, 0, 1, 0, '2016-12-03 12:26:28', 'BRAM-EMB-PR', '', 'We\'re temporarily out of stock, but will get this item to you ASAP.', 'If you selected Customized, enter your custom text:'),
(294, 'BUD-AM-EMB-PR', 'Amitabha Buddha Embellished Print', '<p>Amitabha, or Meditation Buddha, is the Buddha of Infinite Light. His hands are held in the Dhyani mudra, symbolizing absolute balance and equanimity. He presides over Pure Land or the Realm of Bliss. His luminous, discriminating awareness transmutes all attachment and desire.</p>\r\n<p>Custom Print Hand-Embellished With Glitter and Crystals</p>', 'BUD-AM-EMB-PR\r\nAmitabha Buddha Embellished Print', 1.000, 1, 0, 1, 0, '2016-05-31 18:20:30', 'BUD-AM-EMB-PR', 'Amitabha Buddha. Buddha of Infinite Light, Lord of Pure Land, the enlightened one, Siddhartha', '', ''),
(295, 'BUD-AM-PL-PR', 'Buddha Print', '<p>Custom Print</p>', 'Bud-AM-PL-PR', 1.000, 1, 1, 1, 0, '2013-04-09 14:44:31', 'Bud-AM-PL-PR', '', '', ''),
(296, 'BUD-MD-EMB-PR', 'Medicine Buddha Embellished Print', '<p>The Master of remedies releases all sentient beings from affliction. He holds in his right hand a sprig of chebulic myrobalm from which Tibetan medicine is compounded. In his left hand he holds a bowl that contains three forms of ambrosia: the nectar that cures disease and resurrects the dead: the nectar that counteracts aging; and the supreme nectar that illuminates the mind and increases knowledge.</p>\r\n<p>Custom Print Hand-embellished with Glitter and Crystals</p>', 'BUD-MD-EMB-PR\r\nMedicine Buddha Embellished Print', 0.000, 1, 0, 1, 0, '2016-02-16 18:03:19', 'BUD-MD-EMB-PR', 'Medicine Buddha, Buddha, Buddha The Healer, Master of Remedies', 'We\'re temporarily out of stock, but will get this item to you ASAP.', ''),
(297, 'BUD-MD-PL', 'Medicine Buddha Card', '<p class=\"normal\">Healing Medicine Buddha, The Master of Remedies,&nbsp;Card</p>\r\n<p>Greeting Card&nbsp;With Matching Envelope</p>', 'BUD-MD-PL\r\nMedicine Buddha Card', 0.000, 1, 0, 1, 0, '2016-05-01 20:42:16', 'BUD-MD-PL', 'Medicine Buddha, Buddha, Tibetan medicine Buddha, Master of Remedies, health, wellness, get well, vitality, Healing Buddha, Medicine', '', ''),
(715, 'KY-LI-EMB', 'Bodhisattva Kuan Yin Embellished Card', '<p><span>Kuan Yin is the Bodhisattva of Compassion. Her name means \"Hearer of the Cries of the World.\" She is the most beloved and revered of the Chinese deities. Kuan Yin is the Divine Mother we all long for: merciful, tender, compassionate, loving, protecting and wise. She quietly comes to the aid of her children everywhere. Her mantra is \'Om Mani Padme Hum&sbquo;\' or \'Hail the Jewel (or pearl) in the Lotus.\'</span></p>\r\n<p><span><span>Greeting Card&nbsp;Hand-Embellished With Glitter and Crystals, With Matching Envelope</span></span></p>', 'KY-LI-EMB\r\nKuan Yin, the Bodhisattva of Compassion. ', 0.000, 1, 0, 1, 0, '2016-02-15 16:53:30', 'KY-LI-EMB', 'Kuan Yin, Guan Yin, Kanon, Gwan Yin, Kuan Shih Yin, Bodhisattva, Goddess of Compassion, Goddess of Mercy, Buddhist Goddess of Compassion, Hearer of Cries, Divine Mother, Jewel in the Lotus, Compassionate Mother.', '', ''),
(298, 'BUD-MD-PL-PR', 'Medicine Buddha Print', '<p>The Master of remedies releases all sentient beings from affliction. He holds in his right hand a sprig of chebulic myrobalm from which Tibetan medicine is compounded. In his left hand he holds a bowl that contains three forms of ambrosia: the nectar that cures disease and resurrects the dead: the nectar that counteracts aging; and the supreme nectar that illuminates the mind and increases knowledge.</p>\r\n<p>Custom 8 X 10 Art Print</p>', 'BUD-MD-PL-PR\r\nMedicine Buddha Print', 0.000, 1, 0, 1, 0, '2016-04-30 20:03:20', 'BUD-MD-PL-PR', 'Buddha, Medicine Buddha, Master of Remedies, Buddha With Medicine Bowl, health, wellbeing, Longevity, Vitality, get well', 'We\'re temporarily out of stock, but will get this item to you ASAP.', ''),
(787, 'WT-2-PB-EMB-PR', 'Goddess White Tara Embellished Print', '<p>Buddhist Goddess White Tara, From an Original Watercolor by Santa Fe Artist Patti Blair</p>\r\n<p>Custom Print, Hand-Embellished With Glitter and Crystals</p>', 'WT-2-PB-EMB-PR\r\nBuddhist Goddess White Tara Embellished Print', 0.000, 1, 0, 1, 0, '2016-04-05 11:40:49', 'WT-2-PB-EMB-PR', 'Tara, Goddess, White Tara, Buddhist Goddess Tara, Buddhist Mother of Compassion, Goddess of Compassion, art print, Artist Patti Blair, Santa Fe\r\n\r\n', '', ''),
(299, 'BUD-SA-EMB-PR', 'Sakyamuni Buddha Embellished Print', '<p>The Enlightened One - Buddha, in the sixth century BC, at the age of 35, invoked the earth as his witness when he attained Enlightenment. This is indicated by the fingers of his right hand in the \"gesture of touching the earth\". The sun and moon stood still, and all the creatures of the world came to offer obeisance to the Supreme One sitting under the Bodhi Tree.</p>\r\n<p>Custom Print, Hand-embellished with Glitter and Crystals</p>', 'BUD-SA-EMB-PR\r\n\r\nSakyamuni Buddha', 1.000, 1, 0, 1, 0, '2016-02-16 18:06:45', 'BUD-SA-EMB', 'Sakyamuni Buddha, Buddha, Buddha the Enlightened One, Buddha of Infinite Light, Lord of Pure Land, Siddhartha', '', ''),
(773, 'MAR-MIR-EMB-PR', 'Miraculous Mary Embellished Print', '<p class=\"normal\">Miraculous Mary By Charles Chambers Print</p>\r\n<p>8 X 10 Custom Print, Hand-Embellished With Glitter And Crystals.</p>', 'MIR-MAR-EMB-PR\r\n\r\nMiraculous Mary Embellished Print', 0.000, 1, 0, 1, 0, '2016-04-08 17:27:05', 'MIR-MAR-EMB-PR', 'Miraculous Mary, Mary, Mother Mary, Virgin Mary, Charles Chambers, Mother of God, The Virgin', '', ''),
(300, 'BUD-SA-PL-PR', 'Sakyamuni Buddha Print', '<p class=\"normal\">The Enlightened One - Buddha, in the sixth century BC, at the age of 35, invoked the earth as his witness when he attained Enlightenment. This is indicated by the fingers of his right hand in the \"gesture of touching the earth\". The sun and moon stood still, and all the creatures of the world came to offer obeisance to the Supreme One sitting under the Bodhi Tree.</p>\r\n<p>Custom 8 X 10 Art Print</p>', ' BUD-SA-PL-PR\r\n\r\nSakyamuni Buddha Art Print', 1.000, 1, 0, 1, 0, '2016-04-29 19:32:48', 'BUD-SA-PL-PR', 'Buddha, Sakyamuni Buddha, Siddhartha, Supreme One, Lord Buddha', '', ''),
(301, 'BUD-SA-PL', 'Sakyamuni Buddha Card', '<p class=\"normal\">Sakyamuni Buddha, The Enlightened One,&nbsp;Card</p>\r\n<p>Greeting Card&nbsp;With&nbsp;Matching Envelope</p>', 'BUD-SA-PL \r\n\r\nSakyamuni Buddha Card', 1.000, 1, 0, 1, 0, '2016-04-30 20:37:09', 'BUD-SA-PL', 'Sakyamuni Buddha, Buddha, Lord Buddha, enlightened, Supreme One Enlightened One, Enlightenment, Awake, Awakened One', '', ''),
(302, 'CHAK-EMB-PR', 'Chakras Embellished Print', '<p>The word chakra is Sanskrit for wheel or disk, and signifies one of seven basic energy centers in the body. Each of these centers correlates to major nerve ganglia branching forth from the spinal column. In addition, the chakras also correlate to levels of consciousness, archetypal elements, developmental stages of life, colors, sounds, body functions, and much, much more. From an original watercolor by Augusta Lucas-Andreae</p>\r\n<p><span style=\"font-size: 12px; line-height: 14px;\">Custom Hand-Embellished Print With Glitter and Crystals</span></p>', 'CHAK-EMB-PR\r\n\r\nChakras Embellished Print', 0.000, 1, 0, 1, 0, '2016-03-29 19:17:38', 'CHAK-EMB-PR', 'Chakra, chakras energy centers, energy centers in body, nerve ganglia, Sanskrit for wheel, Sanskrit for disk, levels of consciousness, developmental stages of life, Augusta Lucas-Andreae, archetypal elements, energy colors', '', 'If you selected Customized, enter your custom text:'),
