(312, 'CHR-PRO-PL-PR', 'Jesus Christ Print', '<p>Christ The Protector, With&nbsp;Young Child,&nbsp;Art Print</p>\r\n<p>And if you would know God be not therefore a solver of riddles. Rather look about you and you shall see Him playing with your children. And look into space and you shall see Him walking the cloud, outstretching His arms in the lightning and descending in the rain. You shall see Him smiling in the flowers, then rising and waving His hands in the trees. ~ Kahlil Gibran</p>\r\n<p>8 X 10 Custom Art Print</p>', 'CHR-PRO-PL-PR\r\nChrist The Protector Art Print', 1.000, 1, 0, 1, 0, '2016-05-31 18:10:34', 'CHR-PRO-PL-PR', 'Jesus, Jesus Christ, The Compassionate One, Compassion, Christ, The Lord, Our Saviour, Jesus\' Heart, Sacred Heart, Compassionate Heart, The Lord\'s Heart, Protector, Young Child, Children, Christ With Children', '', ''),
