(344, 'JE-LO-PL', 'Jesus Christ In The Wilderness Card', '<p class=\"normal\">Jesus Christ&nbsp;In The Wilderness, In The Lotus Posture, Card</p>\r\n<p>Greeting Card&nbsp;With&nbsp;Matching Envelope</p>', 'JE-LO-PL \r\nJesus In The Wilderness Card', 1.000, 1, 0, 1, 0, '2016-04-07 14:44:58', 'JE-LO-PL', 'Jesus Christ, Lotus Posture, Yoga, The Shepherd, The Messiah, Our Lord, The Saviour, Christ in the Wilderness', '', ''),
(345, 'JE-LO-PL-PR', 'Jesus Christ in Lotus Posture Print', '<p>Jesus Christ in Lotus Posture Print. The Lord is my shepherd; I shall not want.&nbsp;He maketh me to lie down in green pastures: he leadeth me beside the still waters. He restoreth my soul: he leadeth me in the paths of righteousness for his name\'s sake. Yea, though I walk through the valley of the shadow of death, I will fear no evil: for thou art with me; thy rod and thy staff they comfort me. Thou preparest a table before me in the presence of mine enemies: thou anointest my head with oil; my cup runneth over. Surely goodness and mercy shall follow me all the days of my life: and I will dwell in the house of the Lord for ever. ~ 23rd Psalm</p>\r\n<p>Custom Print</p>', 'Jesus Christ in Lotus Posture Print', 1.000, 1, 1, 1, 0, '2014-07-10 15:38:44', 'JE-LO-PL-PR', 'Jesus Christ, Lotus Posture, Yoga, The Shepherd, The Messiah, Our Lord, The Saviour, Christ in the Wilderness', '', ''),
