(354, 'KAL-BLK-EMB-PR', 'Goddess Kali Embellished Print', '<p>Slayer of Time &amp; Death, Destroyer of Illusion: Kali literally means both \'death\' and \'time.\' Goddess Kali represents the state where time, space and causation have disappeared. She is both the destroyer and creatrix and is the consort of Lord Shiva. \"My child, you need not know much in order to please Me. &nbsp;Only Love Me dearly. Speak to me, as you would talk to your mother, if she had taken you in her arms.\"</p>\r\n<p>Custom Print Hand-Embellished With Glitter and Crystals</p>', 'KAL-BLK-EMB-PR\r\nKali Ma Embellished Print', 0.000, 1, 0, 1, 0, '2017-01-28 15:59:38', 'KAL-BLK-EMB-PR', 'Kali, Hindu Goddess Kali, The Black Goddess, Kali Ma, Mother of Durga, Goddess Kali', 'We\'re temporarily out of stock, but will get this item to you ASAP.', 'Enter Your Custom Message Here (an additional fee may apply)'),
