(359, 'KY-DG-EMB-PR', 'Kuan Yin Riding the Dragon Embellished Print', '<p>Kuan YinRiding the Dragon. Kuan Yin&nbsp;is the Bodhisattva of Compassion. Her name means \"Hearer of the Cries of the World.\" She is the most beloved and revered of the Chinese deities. Kuan Yin is the Divine Mother we all long for: merciful, tender, compassionate, loving, protecting and wise. She quietly comes to the aid of her children everywhere. Her mantra is \'Om Mani Padme Hum&sbquo;\' or \'Hail the Jewel (or pearl) in the Lotus.\'</p>\r\n<p>Custom Print Hand-Embellished With Glitter and Crystals</p>\r\n<p>&nbsp;</p>', 'KY-DG-EMB-PR\r\nKuan Yin Riding the Dragon Embellished Print. ', 1.000, 1, 0, 1, 0, '2016-02-15 17:23:28', 'KY-DG-EMB-PR', 'Goddess of Compassion, Goddess of Mercy, Buddhist Goddess of Compassion, Hearer of Cries, Divine Mother, Jewel in the Lotus, Compassionate Mother, Kuan Yin Riding the Dragon, Dragon', '', ''),
