(368, 'LAK-EL-EMB-PR', 'Goddess Lakshmi Embellished Print', '<p>Goddess of Love, Beauty and Prosperity: Salutations to you, Oh Goddess Lakshmi. You are the divine mother, the seat of all prosperity, and worshipped even by the Gods. You hold the conch, the divine wheel and the mace in your hands. We worship the great Goddess and all Hail to the spouse of Vishnu. May Mother Lakshmi stimulate us and make us flourish.</p>\r\n<p>Custom Print Hand-Embellished With Glitter And Crystals</p>', 'LAK-EL-EMB-PR\r\nGoddess Lakshmi Embellished Print', 1.000, 1, 0, 1, 0, '2016-04-09 16:07:43', 'LAK-EL-EMB-PR', 'Goddess Lakshmi, Lakshmi, Goddess of Love, Goddess of Wealth, Goddess of Abundance, Goddess of Beauty, wealth, prosperity, abundance, wealth, Hindu Goddesses, Goddesses, Maha Lakshmi', '', ''),
