(377, 'MAR-HT-1-PL-PR', 'Mother Mary Print', '<p>Hail Mary! Again and again we greet the Mother of God and our Mother sweet. We look on that beautiful, loving face so full of glory, so full of grace. And we sigh for the day when we shall rest in thy tender arms, on thy loving breast. The day when our exile will be past, when thou shalt show us thy Child at last. ~ Cardinal Wiseman</p>\r\n<p>Custom Print</p>', 'MAR-HT-1-PL-PR\r\n\r\nPink Heart Mary\r\n', 1.000, 1, 1, 1, 0, '2015-02-16 15:01:30', 'MAR-HT-1-PL-PR', 'Mother Mary, Pink Heart, Virgin Mary, Madonna', '', ''),
