(379, 'MAR-IM-EMB-PR', 'Immaculate Mary Embellished Print', '<p>\"O Virgin Mary, My Mother. I give to your Immaculate Heart, my body and my soul, my thoughts and my actions. I want to be what you want me to be, and do just what you want me to do. I am not afraid because you are always with me.</p>\r\n<p>Custom Print, Hand-Embellished With Glitter and Crystals</p>', 'MAR-IM-EMB-PR\r\nImmaculate Mary Embellished Print', 1.000, 1, 0, 1, 0, '2016-02-19 15:36:22', 'MAR-IM-EMB-PR', 'Miraculous Mary, Mary, Mother Mary, Virgin Mary, Mother of God, The Virgin, Divine Mother, Madonna, Immaculate Heart', '', ''),
(380, 'MAR-IM-PL-PR', 'Immaculate Mary Print', '<p>Immaculate Mary Print</p>\r\n<p>\"O Virgin Mary, My Mother. I give to your Immaculate Heart, my body and my soul, my thoughts and my actions. I want to be what you want me to be, and do just what you want me to do. I am not afraid because you are always with me. Help me to love your Son Jesus, with all my heart. And above all things, take my hand in yours so I can always be with you. Amen.\"</p>\r\n<p>Custom Art Print</p>', 'MAR-IM-PL-PR \r\n\r\nImmaculate Mary Print\r\n', 1.000, 1, 0, 1, 0, '2016-05-31 18:16:44', 'MAR-IM-PL-PR', 'Miraculous Mary, Mary, Mother Mary, Virgin Mary, Mother of God, The Virgin, Divine Mother, Madonna, Immaculate Heart', '', ''),
(381, 'MAR-OB-EMB-PR', 'Ostra Brama Mary Embellished Print', '<p>Ostra Brama Mary - Circa 1570, this icon is presently found in he chapel of the Dawn Gate of Vilinius, in Lithuania. The Madonna\'s crossed hands show an attitude of prayer and the Mother is depicted without the Child. In 1927 Our Lady of the Dawn Gate was given Papal recognition as a holy pilgrimage site.</p>\r\n<p>Custom Print, Hand-Embellished With Glitter and Crystals</p>', 'MAR-OB-EMB-PR\r\n\r\nMother Mary Embellished Print', 1.000, 1, 0, 1, 0, '2016-04-08 17:41:57', 'MAR-OB-EMB-PR', 'Miraculous Mary, Mary, Mother Mary, Virgin Mary, Mother of God, The Virgin, Divine Mother, Madonna, Ostra Brama Mary, Dawn Gate', '', ''),
