(418, 'RAPH-PL-PR', 'Archangel Raphael Print', '<p>Raphael means \"God Heals.\" Archangel Raphael is always enveloped in a beautiful emerald green light. Green is the color of healing. Raphael is above all, the Angel of Healing. But he is also one of the six angels of Repentance, Prayer, Love, Joy and Light. He is said to be both the friendliest and the funniest of the angel flock.</p>\r\n<p>Custom Print.</p>', 'Raphael means \"God Heals.\" Archangel Raphael is always enveloped in a beautiful emerald green light. Green is the color of healing. Raphael is above all, the Angel of Healing. But he is also one of the six angels of Repentance, Prayer, Love, Joy and Light. He is said to be both the friendliest and the funniest of the angel flock.', 1.000, 1, 1, 1, 0, '2013-05-04 18:10:28', 'RAPH-PL-PR', '', '', ''),
