(847, 'RAP-MOS-EMB-PR', 'Archangel Raphael Embellished Print', '<p class=\"normal\">Archangel Raphael Mosaic Embellished Print</p>\r\n<p>Raphael means \"God Heals.\" Archangel Raphael is always enveloped in a beautiful emerald green light. Green is the color of healing. Raphael is above all, the Angel of Healing. But he is also one of the six angels of Repentance, Prayer, Love, Joy and Light. He is said to be both the friendliest and the funniest of the angel flock.</p>\r\n<p class=\"normal\">Custom Print, Hand-Embellished With Glitter and Crystals</p>', 'RAP-MOS-EMB-PR\r\n\r\nArchangel Raphael Embellished Print', 0.000, 1, 0, 1, 0, '2016-02-09 13:29:50', 'RAP-MOS-EMB-PR', 'archangel raphael, angels, archangels, healing green color, angel of healing, guardian angel, prayer, love, joy, Light', '', ''),
