(843, 'MIC-MOS-EMB-PR', 'Archangel Michael Embellished Print', '<p class=\"normal\">Archangel Michael Slaying The Dragon Mosaic Print</p>\r\n<p class=\"normal\"><span style=\"font-size: 10px;\">His name means \"Who is as God.\" Michael is the Chief of the Archangels, and is the Angel of Repentance, Righteousness, Mercy and Sanctification. He is also known as \"The Prince of Light,\" a spiritual warrior who wages war against the sons of darkness.</span></p>\r\n<p><span style=\"font-size: 12px; line-height: 14px;\">Custom Print, Hand-Embellished With Glitter and Crystals</span></p>', 'MIC-MOS-EMB-PR\r\n\r\nArchangel Michael Embellished Print', 0.000, 1, 0, 1, 0, '2016-02-09 13:32:30', 'MIC-MOS-EMB-PR', 'michael, archangels, archangel michael, dragons, dragon slayer, angels, mosaics', '', ''),
(424, 'META-PL-PR', 'Archangel Metatron Print', '<p>The name Metatron is from the Greek Meta+Tron meaning Beyond+Matrix. Metatron is the highest of the angels and serves as the celestial scribe. He is one of the most important angels in the heavenly hierarchy and transmits the daily orders of God to the angels Gabriel and Sammael. He is a member of a special group that is permitted to look at God&sbquo;&Auml;&ocirc;s countenance - an honor most angels do not share. In the literature, Metatron is often referred to as \"the Prince of the Countenance.\"</p>\r\n<p>Custom Print</p>', 'The name Metatron is from the Greek Meta+Tron meaning Beyond+Matrix. Metatron is the highest of the angels and serves as the celestial scribe. He is one of the most important angels in the heavenly hierarchy and transmits the daily orders of God to the angels Gabriel and Sammael. He is a member of a special group that is permitted to look at Gods countenance - an honor most angels do not share. In the literature, Metatron is often referred to as \"the Prince of the Countenance.\"', 1.000, 1, 1, 1, 0, '2013-05-04 18:09:43', 'META-PL-PR', '', '', ''),
