(427, 'MC-MS-PL', 'Kasperovskaya Mother Mary & Child Card', '<p class=\"normal\">Message Mary, the Russian icon is called the Kasperovskaya Mother. The \"Message\" in the Child\'s hand has to be delivered by Mother to the people.&nbsp;</p>\r\n<p>Greeting Card&nbsp;With Matching Envelope</p>', 'MC-MS-PL\r\nKasperovskaya Mother and Child, The Message, Card', 1.000, 1, 0, 1, 0, '2016-04-07 10:30:05', 'MC-MS-PL', 'Mary and Child, Mother and Child, Mary and Baby Jesus, Madonna and Child, Orthodox Mother and Child, Message, Mary\'s Message, Kasperovskaya Mother', '', ''),
(428, 'MC-MS-EMB', 'Kasperovskaya Mother & Child Embellished Card', '<p class=\"normal\">Message Mary, the Russian Orthodox Icon, is called the Kasperovskaya Mother. The \"Message\" in the Child\'s hand has to be delivered by Mother to the people.&nbsp;</p>\r\n<p>Greeting Card&nbsp;Hand-Embellished With Glitter And Crystals, With Matching Envelope</p>', 'MC-MS-EMB\r\nKasperovskaya Mother and Child Message Embellished Card', 1.000, 1, 0, 1, 0, '2016-04-08 17:36:11', 'MC-MS-EMB', 'Mary and Child, Mother and Child, Mary and Baby Jesus, Madonna and Child, Orthodox Mother and Child, Icon, Message, Mary\'s Message', '', ''),
(429, 'MC-MS-EMB-PR', 'Kasperovskaya Mother & Child Embellished Print', '<p><span><span>Message Mary, the Russian icon is called the Kasperovskaya Mother. The \"Message\" in the Child\'s hand has to be delivered by Mother to the people. It was told that the icon became miraculously clear and started to work miracles after an old woman prayed in front of it for relief from her sorrows. The icon is also credited with saving the city during the seige of Odessa during the Crimean War which lasted from 1853-1856.</span></span></p>\r\n<p>8 X 10 Custom Print, Hand-Embellished With Glitter And Crystals</p>', 'MC-MS-EMB-PR\r\n\r\nKasperovskaya Mother And Child Message Embellished Print', 1.000, 1, 0, 0, 0, '2016-04-08 17:37:59', 'MC-MS-EMB-PR', 'Mother and Child, Madonna and Child, Mary and Child, Baby Jesus, Christ Child, Mother Mary, Immaculate Conception, Message, World, Kasperovskaya Mother', '', ''),
(430, 'MC-MS-PL-PR', 'Mother Mary & Child Print', '<p>Message Mary, the Russian icon is called the Kasperovskaya Mother. The \"Message\" in the Child\'s hand has to be delivered by Mother to the people. It was told that the icon became miraculously clear and started to work miracles after an old woman prayed in front of it for relief from her sorrows. The icon is also credited with saving the city during the seige of Odessa during the Crimean War which lasted from 1853-1856.</p>\r\n<p>8 1/2 X 11 Custom Art Print</p>', 'MC-MS-PL-PR\r\nMother and Child Message Orthodox Print', 1.000, 1, 0, 1, 0, '2016-05-31 18:24:09', 'MC-MS-PL-PR', 'Mary and Child, Mother and Child, Mary and Baby Jesus, Madonna and Child, Orthodox Mother and Child, Icon, Message, Mary\'s Message', '', ''),
