(432, 'MC-FL-PL-PR', 'Mother Mary & Child Print', '<p>\"Hail Mary! Again and again we greet the Mother of God and our Mother sweet. We look on that beautiful, loving face so full of glory, so full of grace. And we sigh for the day when we shall rest In thy tender arms, on thy loving breast.\nThe day when our exile will be past when thou shalt show us thy Child at last.\"\n~ Cardinal Wiseman</p><p>Custom Print</p>', '\"Hail Mary! Again and again we greet the Mother of God and our Mother sweet. We look on that beautiful, loving face so full of glory, so full of grace. And we sigh for the day when we shall rest In thy tender arms, on thy loving breast.\nThe day when our exile will be past when thou shalt show us thy Child at last.\"\n~ Cardinal Wiseman', 1.000, 1, 1, 1, 0, NULL, NULL, NULL, NULL, NULL),
