(605, 'CHEN-GD--EMB', 'Chenrezig Embellished Card', '<p><span class=\"normal\">Chenrezig, Embodiment of Compassion</span></p>\r\n<p>\"Every person whose heart is moved by love and compassion,<br />who deeply and sincerely acts for the benefit of others without concern for fame, profit, social position, or recognition, expresses the activity of Chenrezig.\"&nbsp; ...Bokar Rinpoche...</p>\r\n<p>Greeting Card Hand-Embellished With Glitter and Crystals, With Matching Envelope</p>', 'CHEN-GD-EMB\r\nGoddess Chenrezig, Embodiment of Compassion Card\r\n', 0.000, 1, 0, 1, 0, '2016-02-16 18:42:35', 'CHEN-GD-EMB', 'Chenrezig, goddess of compassion, compassion, Bodhisattva of compassion, Buddhist, Buddhist Gods, love and compassion, sincere acts, Bokar Rinpoche', '', ''),
