(607, 'KY-PL-EMB', 'Kuan Yin on Pink Lotus Embellished Card', '<p>\"Listen to the deeds of Kuan Yin...<br />Responding compassionately on every side.<br />With great vows, deep as the ocean, through inconceivable periods of time.<br />Serving innumerable Buddhas, giving great, clear, and pure vows...<br />To hear her name, to see her body, to hold her in the heart, is not in vain.<br />For she can extinguish the suffering of existence.\"<br />~From the Buddhist Lotus Sutra~</p>\r\n<p>Greeting Card Hand-Embellished With Glitter and Crystals, With Matching&nbsp;Envelope</p>', 'KY-PL-EMB    \r\n\r\nKuan Yin On a Pink Lotus Card\r\n\r\n', 0.000, 1, 0, 1, 0, '2016-02-15 17:50:03', 'KY-PL-EMB', 'Bodhisattva Kuan Yin, Kwan Yin, Guan Yin, Guan Shih Yin, Kuan Shih Yin, Quan Am, Guanyin, Kuanin,Great Mother, Goddess of Mercy, Mother of Compassion, Avalokitesvara, Mazu, A-ma, Matsu, Goddess of the Southern Sea, Kwannon, Divine Nectar, Nectar of Compassion', '', ''),
(608, 'KY-GD-EMB', 'Kuan Yin Sitting In a Lotus Patch Embellished Card', '<p>Kuan Yin, Bodhisattva of Compassion<br />Listen to the deeds of Kuan Yin...<br />Responding compassionately on every side.<br />With great vows, deep as the ocean, through inconceivable periods of time.<br />Serving innumerable Buddhas, giving great, clear, and pure vows...<br />To hear her name, to see her body, to hold her in the heart, is not in vain.<br />For she can erxtinguish the suffering of existence.</p>\r\n<p>~From the Buddhist Lotus Sutra~</p>\r\n<p>Greeting Card&nbsp;Hand-Embellished With Glitter and Crystals, With Matching&nbsp;Envelope</p>', 'KY-GD-EMB\r\n\r\nKuan Yin Sitting In a Lotus Patch Embellished Card', 0.000, 1, 0, 1, 0, '2016-04-03 15:44:48', 'KY-GD-EMB', 'Bodhisattva Kuan Yin, Kwan Yin, Guan Yin, Guan Shih Yin, Kuan Shih Yin, Quan Am, Guanyin, Kuanin,Great Mother, Goddess of Mercy, Mother of Compassion, Avalokitesvara, Mazu, A-ma, Matsu, Goddess of the Southern Sea, Kwannon (Japan), Lotus patch, Lotus flower, Flowers', '', ''),
(609, 'DUR-OL-EMB', 'Durga Ma, Mother of The Universe Embellished Card', '<p>Durga means Invincible. She is all forms of the Divine Mother herself.<br />She is produced from all the radiance of all the gods and therefore has their essence in her.</p>\r\n<p>Greeting Card Hand-Embellished With Glitter and Crystals, With Matching Envelope</p>', 'DUR-OL-EMB\r\nDurga Ma, Mother of The Universe\r\n', 0.000, 1, 0, 1, 0, '2016-02-20 15:56:14', 'DUR-OL-EMB', 'Durga Ma, Hindu Goddess Durga, Universal Divine Mother, Invincible Goddess, Banisher of Darkness, Kali\'s Mother', '', ''),
