(610, 'KRI-FLU-EMB', 'Krishna With Flute Embellished Card', '<p>Krishna With Flute Card<br />O Lord, protector of cattle, sea of compassion, consort of Mahalakshmi, the daughter of the ocean and milk, slayer of Kamsa, bestower of endless mercy upon the elephant chief in his distress, Maadhava known through contemplation, younger brother of Balarama, Lord of the three worlds, lotus eyed one, protector of the gopis, protect me, for I know not anyone but you.</p>\r\n<p>Greeting Card Hand-embellished with Glitter and Crystals, with Pearl or Gold Envelope</p>', 'KRI-FLU-EMB\r\nKrishna With Flute\r\n', 0.000, 1, 0, 1, 0, '2016-02-20 15:01:28', 'KRI-FLU-EMB', 'Krishna, Krishna with Flute, gopis, Lord Krishna, Krishna, Lord of Love', '', ''),
