(612, 'K&R-3-EMB', 'Krishna and Radha Embellished Card', '<p>Krishna and Radha<br />Krishna Braiding Radha\'s Hair<br />Lord Krishna is the eighth incarnation of Lord Vishnu.<br />He is the supreme statesman, warrior, hero, teacher and philosopher, and author of the Bhagavad Gita.<br />He has been called \"The Divine Ecstatic\" because the sound of Krishna\'s flute beckons souls to awaken and to become absorbed in the call of the Divine. <br />Radha is Lord Krishna\'s consort-she symbolizes the individual soul that yearns for , and then awakens to the love of God: finally realizing complete Divine Union.</p>\r\n<p>Greeting Card Hand-Embellished With Glitter and Crystals, With matching Envelope</p>', 'K&R-3-EMB\r\nKrishna and Radha, Krishna Braiding Radha\'s Hair\r\n', 0.000, 1, 0, 1, 0, '2016-02-20 15:08:01', 'K&R-3-EMB', 'Krishna and Radha, Hindu Divine Couple, Lord Krishna and His Consort Radha, Braiding Hair', '', ''),
(779, 'SHI-3-EMB-PR', 'Lord Shiva Embellished Print', '<p class=\"normal\">Lord Shiva, Hindu Supreme God Print</p>\r\n<p>Hand-Embellished Print</p>', 'SHI-3-EMB-PR\r\nLord Shiva Embellished Print', 0.000, 1, 0, 1, 0, '2016-04-15 16:21:14', 'SHI-3-EMB-PR', 'Shiva, Lord Shiva, Hindu Lord, Hindu Lord of Dissolution, Shiva the Destroyer, Lord of Mercy and Compassion, One God of the Hindu Trinity', '', ''),
(613, 'MIC-BLK', 'Archangel Michael Embellished Card', '<p>Archangel Michael<br />His name means \"Who is as God.\"<br />Michael is the Chief of the Archangels, and is the Angel of Repentance, Righteousness, Mercy and Sanctification.<br />He is also known as \"The Prince of Light,\"<br />a spiritual warrior who wages war against the sons of darkness.</p>\r\n<p>Greeting Card with Colored Envelope</p>', 'MIC-BLK-EMB\r\nArchangel Michael\r\nHis name means \"Who is as God.\"\r\nMichael is the Chief of the Archangels, and is the Angel of Repentance, Righteousness, Mercy and Sanctification.\r\nHe is also known as \"The Prince of Light,\"\r\na spiritual warrior who wages war against the sons of darkness. ', 0.000, 1, 1, 1, 0, '2016-02-08 17:23:01', 'MIC-BLK-EMB', 'Archangel Michael, Michael, archangels, Prince of Light', '', ''),
(614, 'AR-GAB-EMB', 'Archangel Gabriel Embellished Card', '<p class=\"normal\">Archangel Gabriel Holding Flowers Embellished Card</p>\r\n<p>Hand-Embellished Card With Glitter And Crystals, With Matching Envelope</p>', 'AR-GAB-EMB\r\n\r\nArchangel Gabriel Embellished Card\r\n', 0.000, 1, 0, 1, 0, '2016-04-08 17:15:22', 'AR-GAB-EMB', 'Archangel Gabriel, Gabriel, Garden of Eden, angel of annunciation, angels, archangels, flowers', 'We\'re temporarily out of stock, but will get this item to you ASAP.', ''),
(844, 'AR-GAB-EMB-PR', 'Archangel Gabriel Embellished Print', '<p class=\"normal\">Archangel Gabriel Hand-Embellished Print</p>\r\n<p>Gabriel means \"God is my strength.\" &nbsp;He is one of the most beloved and highest ranked of all angels. &nbsp;Gabriel is the Angel of Annunciation, Resurrection, Mercy, Death and Revelation. &nbsp;He sits at the left hand of God and is guardian of the Garden of Eden, and chief of the cherubim.</p>\r\n<p class=\"normal\">Custom Print, Hand-Embellished With Glitter and Crystals</p>', 'AR-GAB-EMB-PR\r\n\r\nArchangel Gabriel Embellished Print', 0.000, 1, 0, 1, 0, '2016-04-08 17:17:11', 'AR-GAB-EMB-PR', '', '', ''),
