(846, 'GAB-MOS-EMB-PR', 'Archangel Gabriel Mosaic Embellished Print', '<p class=\"normal\">Archangel Gabriel Mosaic Embellished Print</p>\r\n<p class=\"smallprint\">Gabriel means \"God is my strength.\" He is one of the most beloved and highest ranked of all angels. &nbsp;Gabriel is the Angel of Annunciation, Resurrection, Mercy, Death and Revelation. &nbsp;He sits at the left hand of God and is guardian of the Garden of Eden, and chief of the cherubim.</p>\r\n<p class=\"normal\"><span>Custom Print, Hand-Embellished With Glitter and Crystals</span></p>', 'GAB-MOS-EMB-PR\r\n\r\nArchangel Gabriel Mosaic Embellished Print', 0.000, 1, 0, 1, 0, '2016-02-09 13:30:21', 'GAB-MOS-EMB-PR', 'Archangel gabriel, Gabriel, angels, archangels, angel of annunciation', '', ''),
