(621, 'LOT-PK-FL', 'Pink Lotus Card', '<p>Pink Lotus<br />The Lotus flower symbolizes divine purity and enlightenment, as well as regeneration and rebirth.<br />This sacred flower grows in deep mud and closes and sinks in the water at night, rising and opening again at dawn, just like the sun.<br />Out of the depths of darkness, sooner or later the Lotus reaches the Light, becoming the most beautiful flower ever....and it is the same for us; we are born, we toil, we grow and learn, and eventually we evolve into Perfection.</p>', 'LOT-PK-PL\r\n\r\nPink Lotus\r\nThe Lotus flower symbolizes divine purity and enlightenment, as well as regeneration and rebirth.\r\nThis sacred flower grows in deep mud and closes and sinks in the water at night, rising and opening again at dawn, just like the sun.\r\nOut of the depths of darkness, sooner or later the Lotus reaches the Light, becoming the most beautiful flower ever....and it is the same for us; we are born, we toil, we grow and learn, and eventually we evolve into Perfection.', 0.000, 1, 1, 1, 0, '2013-09-26 12:38:55', 'LOT-PK-PL', 'Lotus, pink flowers, pink lotus, flowers', '', ''),
