(653, 'KOKO-2', 'Kokopelli', '<p><br />Kokopelli<br />Prankster, Healer, Storyteller, and Fertility God, Kokopelli is a sacred figure to the Southwestern Native Americans.<br />Carvings and paintings of his image in rockwalls and boulders date back to over 3,000 years.<br />According to legend, he traveled from village to village bringing with him the changing of the seasons: of Winter to Spring...melting the snow and bringing about much needed rain fora successful harvest.<br />The hunch on his back is a sack of seeds and all the songs that he carried with him.</p>', 'KOKO-2\r\nKokopelli\r\nPrankster, Healer, Storyteller, and Fertility God, Kokopelli is a sacred figure to the Southwestern Native Americans.\r\nCarvings and paintings of his image in rockwalls and boulders date back to over 3,000 years.\r\nAccording to legend, he traveled from village to village bringing with him the changing of the seasons: of Winter to Spring...melting the snow and bringing about much needed rain fora  successful harvest.\r\nThe hunch on his back is a sack of seeds and all the songs that he carried with him.', 0.000, 1, 1, 1, 0, '2013-09-25 17:19:28', 'KOKO-2', 'Kokopelli, Southwestern, Native American, prankster, healer, storyteller', '', ''),
