(841, 'AR-MIC-EMB-PR', 'Warrior Michael Embellished Print', '<p class=\"normal\">Archangel Michael, The Warrior Angel in Full Armor</p>\r\n<p class=\"smallprint\">His name means \"Who is as God.\"<br />Michael is the Chief of the Archangels, and is the Angel of Repentance, Righteousness, Mercy and Sanctification.<br />He is also known as \"The Prince of Light,\" a spiritual<br />warrior who wages war against the sons of darkness.</p>\r\n<p class=\"normal\">Custom Print, Hand-Embellished With Glitter and Crystals</p>', 'AR-MIC-EMB-PR\r\n\r\nArchangel Michael Embellished Print', 0.000, 1, 0, 1, 0, '2016-02-09 13:34:50', 'AR-MIC-EMB-PR', 'archangel Michael, angelic realm, angels, Michael, divine warrior ', '', ''),
(842, 'MIC-BLK-EMB-PR', 'Michael Embellished Print', '<p class=\"normal\">Archangel Michael&nbsp;Holding Sword and Staff</p>\r\n<p class=\"smallprint\">His name means \"Who is as God.\"<br />Michael is the Chief of the Archangels, and is the Angel of Repentance, Righteousness, Mercy and Sanctification.<br />He is also known as \"The Prince of Light,\" a spiritual<br />warrior who wages war against the sons of darkness.</p>\r\n<p class=\"normal\">Custom Print, Hand-Embellished With Glitter and Crystals</p>', 'MIC-BLK-EMB-PR\r\n\r\nMichael Embellished Print', 0.000, 1, 0, 1, 0, '2016-02-09 13:33:43', 'MIC-BLK-EMB-PR', 'archangel michael, sword, staff, angel, michael', '', ''),
(850, 'KY-PL-EMB-PR', 'Kuan Yin On a Pink Lotus Embellished Print', '<p>\"Listen to the deeds of Kuan Yin responding compassionately on every side with great vows, deep as the ocean, through inconceivable periods of time, serving innumerable Buddhas, giving great, clear, and pure vows. To hear her name, to see her body, to hold her in the heart, is not in vain, for she can extinguish the suffering of existence.\" ~ From the Buddhist Lotus Sutra</p>\r\n<p>Custom Print, Hand-Embellished With Glitter and Crystals&nbsp;</p>', 'KY-PL-EMB-PR\r\n\r\nKuan Yin On a Pink Lotus Embellished Print', 0.000, 1, 0, 1, 0, '2016-02-15 17:49:32', 'KY-PL-EMB-PR', 'Bodhisattva Kuan Yin, Kwan Yin, Guan Yin, Guan Shih Yin, Kuan Shih Yin, Quan Am, Guanyin, Kuanin,Great Mother, Goddess of Mercy, Mother of Compassion, Avalokitesvara, Mazu, A-ma, Matsu, Goddess of the Southern Sea, Kwannon, Divine Nectar, Nectar of Compassion', '', ''),
(854, 'KY-LI-EMB-PR', 'Goddess Kuan Yin Riding The Dragon Print', '<p>Kuan Yin&nbsp;is the Bodhisattva of Compassion. Her name means \"Hearer of the Cries of the World.\" She is the most beloved and revered of the Chinese deities. Kuan Yin is the Divine Mother we all long for: merciful, tender, compassionate, loving, protecting and wise. She quietly comes to the aid of her children everywhere. Her mantra is \'Om Mani Padme Hum&sbquo;\' or \'Hail the Jewel (or pearl) in the Lotus.\'</p>\r\n<p>Custom Print, Hand-Embellished With Glitter and Crystals</p>\r\n<p>&nbsp;</p>', 'KY-LI-EMB-PR\r\nGoddess Kuan Yin Riding The Dragon Embellished Print', 0.000, 1, 0, 1, 0, '2016-02-15 18:21:53', 'KY-LI-EMB-PR', 'Goddess of Compassion, Goddess of Mercy, Buddhist Goddess of Compassion, Hearer of Cries, Divine Mother, Jewel in the Lotus, Compassionate Mother, Kuan Yin Riding the Dragon, Dragon', '', ''),
(851, 'KY-LP-NE-EMB-PR', 'Kuan Yin\'s Lordly Pose Embellished Print', '<p>\"Listen to the deeds of Kuan Yin responding compassionately on every side with great vows, deep as the ocean, through inconceivable periods of time, serving innumerable Buddhas, giving great, clear, and pure vows. To hear her name, to see her body, to hold her in the heart, is not in vain, for she can extinguish the suffering of existence.\" ~ From the Buddhist Lotus Sutra</p>\r\n<p>Custom Print, Hand-Embellished With Glitter and Crystals</p>', 'KY-LP-NE-EMB-PR\r\nKuan Yin\'s Lordly Pose Embellished Print', 0.000, 1, 0, 1, 0, '2016-04-02 17:17:35', 'KY-LP-NE-EMB-PR', 'Bodhisattva Kuan Yin, Kwan Yin, Guan Yin, Guan Shih Yin, Kuan Shih Yin, Quan Am, Guanyin, Kuanin,Great Mother, Goddess of Mercy, Mother of Compassion, Avalokitesvara, Mazu, A-ma, Matsu, Goddess of the Southern Sea, Kwannon, Divine Nectar, Nectar of Compassion', '', ''),
(852, 'KY-DR-2-EMB-PR', 'Kuan Yin Riding The Dragon Embellished Print', '<p>Kuan Yin is the Bodhisattva of Compassion. Her name means \"Hearer of the Cries of the World.\" She is the most beloved and revered of the Chinese deities. Kuan Yin is the Divine Mother we all long for: merciful, tender, compassionate, loving, protecting and wise. She quietly comes to the aid of her children everywhere. Her mantra is \'Om Mani Padme Hum&sbquo;\' or \'Hail the Jewel (or pearl) in the Lotus.\'</p>\r\n<p>Custom Print Hand-Embellished With Glitter and Crystals</p>', 'KY-DR-2-EMB-PR\r\nKuan Yin Riding The Dragon Embellished Print', 0.000, 1, 0, 1, 0, '2016-02-15 18:02:55', 'KY-DR-2-EMB-PR', 'Bodhisattva Kuan Yin, Kwan Yin, Guan Yin, Guan Shih Yin, Kuan Shih Yin, Quan Am, Guanyin, Kuanin,Great Mother, Goddess of Mercy, Mother of Compassion, Avalokitesvara, Mazu, A-ma, Matsu, Goddess of the Southern Sea, Kwannon', '', ''),
